import 'package:wnews/wnews.dart';
import 'package:test/test.dart';

void main() {
  test('throws from empty string', () {
    expect(() => extractNews(''), throwsArgumentError);
  });

  test('extracts the correct number of news items', () {
    expect(extractNews(_json).length, 4);
  });

  test('the first item is correct', () {
    final firstItem = extractNews(_json).first;
    expect(firstItem.text, contains('Texas Rangers'));
    expect(firstItem.link, isNotNull);
  });

  test('constructs endpoint URI', () {
    final uri = getEndpointUri();
    expect(uri.scheme, 'https');
    expect(uri.host, 'api.wikimedia.org');
    expect(uri.pathSegments, contains('en'));
    expect(uri.pathSegments, contains('featured'));
  });
}

