 United States. Accessible worldwide, it was launched on February 14, 2005, by Steve Chen, Chad Hurley, and Jawed Karim. It is owned by Google and is the second most visited website in the world, after Google Search. YouTube has more than 2.5 billion monthly users, who collectively watch more than one billion hours of videos every day. As of May 2019, videos were being uploaded to the platform at a rate of more than 500 hours of content per minute.","extract_html":"<p><b>YouTube</b> is an online video sharing and social media platform headquartered in San Bruno, California, United States. Accessible worldwide, it was launched on February 14, 2005, by Steve Chen, Chad Hurley, and Jawed Karim. It is owned by Google and is the second most visited website in the world, after Google Search. YouTube has more than 2.5 billion monthly users, who collectively watch more than one billion hours of videos every day. As of May 2019, videos were being uploaded to the platform at a rate of more than 500 hours of content per minute.</p>","normalizedtitle":"YouTube"},{"views":172513,"rank":15,"view_history":[{"date":"2023-10-29Z","views":34631},{"date":"2023-10-30Z","views":46501},{"date":"2023-10-31Z","views":74928},{"date":"2023-11-01Z","views":329066},{"date":"2023-11-02Z","views":172513}],"type":"standard","title":"Day_of_the_Dead","displaytitle":"<span class=\"mw-page-title-main\">Day of the Dead</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q309256","titles":{"canonical":"Day_of_the_Dead","normalized":"Day of the Dead","display":"<span class=\"mw-page-title-main\">Day of the Dead</span>"},"pageid":52303,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1e/Altardediademuertos.jpg/320px-Altardediademuertos.jpg","width":320,"height":478},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Altardediademuertos.jpg","width":2541,"height":3796},"lang":"en","dir":"ltr","revision":"1183170515","tid":"e3070050-799c-11ee-b744-ef7e28d9be16","timestamp":"2023-11-02T16:28:35Z","description":"Mexican multi-day holiday","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Day_of_the_Dead","revisions":"https://en.wikipedia.org/wiki/Day_of_the_Dead?action=history","edit":"https://en.wikipedia.org/wiki/Day_of_the_Dead?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Day_of_the_Dead"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Day_of_the_Dead","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Day_of_the_Dead","edit":"https://en.m.wikipedia.org/wiki/Day_of_the_Dead?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Day_of_the_Dead"}},"extract":"The Day of the Dead is a holiday traditionally celebrated on November 1 and 2, though other days, such as October 31 or November 6, may be included depending on the locality. It is widely observed in Mexico, where it largely developed, and is also observed in other places, especially by people of Mexican heritage. Although related to the simultaneous Christian remembrances for Hallowtide, it has a much less solemn tone and is portrayed as a holiday of joyful celebration rather than mourning. Some argue that there are Indigenous Mexican or ancient Aztec influences that account for the custom, and it has become a way to remember those forebears of Mexican culture. The multi-day holiday involves family and friends gathering to pay respects and to remember friends and family members who have died. These celebrations can take a humorous tone, as celebrants remember funny events and anecdotes about the departed.","extract_html":"<p>The <b>Day of the Dead</b> is a holiday traditionally celebrated on November 1 and 2, though other days, such as October 31 or November 6, may be included depending on the locality. It is widely observed in Mexico, where it largely developed, and is also observed in other places, especially by people of Mexican heritage. Although related to the simultaneous Christian remembrances for Hallowtide, it has a much less solemn tone and is portrayed as a holiday of joyful celebration rather than mourning. Some argue that there are Indigenous Mexican or ancient Aztec influences that account for the custom, and it has become a way to remember those forebears of Mexican culture. The multi-day holiday involves family and friends gathering to pay respects and to remember friends and family members who have died. These celebrations can take a humorous tone, as celebrants remember funny events and anecdotes about the departed.</p>","normalizedtitle":"Day of the Dead"},{"views":170228,"rank":16,"view_history":[{"date":"2023-10-29Z","views":148296},{"date":"2023-10-30Z","views":163776},{"date":"2023-10-31Z","views":171334},{"date":"2023-11-01Z","views":178882},{"date":"2023-11-02Z","views":170228}],"type":"standard","title":"2023_Israel–Hamas_war","displaytitle":"<span class=\"mw-page-title-main\">2023 Israel–Hamas war</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q122962941","titles":{"canonical":"2023_Israel–Hamas_war","normalized":"2023 Israel–Hamas war","display":"<span class=\"mw-page-title-main\">2023 Israel–Hamas war</span>"},"pageid":74998519,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3d/October_2023_Gaza%E2%88%92Israel_conflict.svg/320px-October_2023_Gaza%E2%88%92Israel_conflict.svg.png","width":320,"height":277},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3d/October_2023_Gaza%E2%88%92Israel_conflict.svg/3763px-October_2023_Gaza%E2%88%92Israel_conflict.svg.png","width":3763,"height":3258},"lang":"en","dir":"ltr","revision":"1183294038","tid":"6f0d0050-7a41-11ee-85ae-cb7b1bd4977a","timestamp":"2023-11-03T12:04:59Z","description":"Ongoing armed conflict in the Middle East","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/2023_Israel%E2%80%93Hamas_war","revisions":"https://en.wikipedia.org/wiki/2023_Israel%E2%80%93Hamas_war?action=history","edit":"https://en.wikipedia.org/wiki/2023_Israel%E2%80%93Hamas_war?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:2023_Israel%E2%80%93Hamas_war"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/2023_Israel%E2%80%93Hamas_war","revisions":"https://en.m.wikipedia.org/wiki/Special:History/2023_Israel%E2%80%93Hamas_war","edit":"https://en.m.wikipedia.org/wiki/2023_Israel%E2%80%93Hamas_war?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:2023_Israel%E2%80%93Hamas_war"}},"extract":"An armed conflict between Hamas-led Palestinian militant groups and Israeli military forces broke out on 7 October 2023, with a Hamas attack on southern Israel, to which Israeli military forces retaliated with extensive strikes against Palestine's Gaza Strip and a subsequent invasion of Gaza. By the end of October, more than 1,500 Israelis and more than 8,000 Palestinians had been killed, including more than 3,000 children, while over 230 Israelis and foreign nationals remained captured or taken as hostages.","extract_html":"<p>An armed conflict between Hamas-led Palestinian militant groups and Israeli military forces broke out on 7 October 2023, with a Hamas attack on southern Israel, to which Israeli military forces retaliated with extensive strikes against Palestine's Gaza Strip and a subsequent invasion of Gaza. By the end of October, more than 1,500 Israelis and more than 8,000 Palestinians had been killed, including more than 3,000 children, while over 230 Israelis and foreign nationals remained captured or taken as hostages.</p>","normalizedtitle":"2023 Israel–Hamas war"},{"views":161985,"rank":17,"view_history":[{"date":"2023-10-29Z","views":6701},{"date":"2023-10-30Z","views":26150},{"date":"2023-10-31Z","views":5494},{"date":"2023-11-01Z","views":6492},{"date":"2023-11-02Z","views":161985}],"type":"standard","title":"Sri_Lanka_national_cricket_team","displaytitle":"<span class=\"mw-page-title-main\">Sri Lanka national cricket team