am is administered by Sri Lanka Cricket.","extract_html":"<p>The <b>Sri Lanka men's national cricket team</b>, nicknamed <b>The Lions</b>, represents Sri Lanka in men's international cricket. It is a Full Member of the International Cricket Council (ICC) with Test, One-Day International (ODI) and T20 International (T20I) status. The team first played international cricket in 1926–27 and became an associate member of ICC in 1965. They were later awarded Test status in 1981, which made Sri Lanka the eighth Test cricket-playing nation. The team is administered by Sri Lanka Cricket.</p>","normalizedtitle":"Sri Lanka national cricket team"},{"views":159000,"rank":18,"view_history":[{"date":"2023-10-29Z","views":2060},{"date":"2023-10-30Z","views":34065},{"date":"2023-10-31Z","views":111610},{"date":"2023-11-01Z","views":110421},{"date":"2023-11-02Z","views":159000}],"type":"disambiguation","title":"XXXX","displaytitle":"<span class=\"mw-page-title-main\">XXXX</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q8042634","titles":{"canonical":"XXXX","normalized":"XXXX","display":"<span class=\"mw-page-title-main\">XXXX</span>"},"pageid":1384520,"lang":"en","dir":"ltr","revision":"1106366030","tid":"4d547790-3bfd-11ee-bd51-b72dfc6e8bd0","timestamp":"2022-08-24T07:15:26Z","description":"Topics referred to by the same term","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/XXXX","revisions":"https://en.wikipedia.org/wiki/XXXX?action=history","edit":"https://en.wikipedia.org/wiki/XXXX?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:XXXX"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/XXXX","revisions":"https://en.m.wikipedia.org/wiki/Special:History/XXXX","edit":"https://en.m.wikipedia.org/wiki/XXXX?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:XXXX"}},"extract":"XXXX may refer to:","extract_html":"<p><b>XXXX</b> may refer to:</p>","normalizedtitle":"XXXX"},{"views":157921,"rank":19,"view_history":[{"date