lm co-written and directed by Atlee in his Hindi film debut. It is produced by Gauri Khan and Gaurav Verma under Red Chillies Entertainment. The film stars Shah Rukh Khan in a dual role as father and son who team up to rectify corruption in society. Nayanthara, Vijay Sethupathi, Deepika Padukone, Priyamani and Sanya Malhotra appear in supporting roles.</p>","normalizedtitle":"Jawan (film)"},{"views":154169,"rank":20,"view_history":[{"date":"2023-10-29Z","views":159024},{"date":"2023-10-30Z","views":154157},{"date":"2023-10-31Z","views":157012},{"date":"2023-11-01Z","views":156983},{"date":"2023-11-02Z","views":154169}],"type":"standard","title":"Cleopatra","displaytitle":"<span class=\"mw-page-title-main\">Cleopatra</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q635","titles":{"canonical":"Cleopatra","normalized":"Cleopatra","display":"<span class=\"mw-page-title-main\">Cleopatra</span>"},"pageid":60827,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3e/Kleopatra-VII.-Altes-Museum-Berlin1.jpg/320px-Kleopatra-VII.-Altes-Museum-Berlin1.jpg","width":320,"height":424},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Kleopatra-VII.-Altes-Museum-Berlin1.jpg","width":1149,"height":1523},"lang":"en","dir":"ltr","revision":"1182409579","tid":"a8c40c90-7617-11ee-ab26-a394457b4b34","timestamp":"2023-10-29T04:57:11Z","description":"Queen of Egypt from 51 to 30 BC","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Cleopatra","revisions":"https://en.wikipedia.org/wiki/Cleopatra?action=history","edit":"https://en.wikipedia.org/wiki/Cleopatra?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Cleopatra"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Cleopatra","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Cleopatra","edit":"https://en.m.wikipedia.org/wiki/Cleopatra?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Cleopatra"}},"extract":"Cleopatra VII Thea Philopator was Queen of the Ptolemaic Kingdom of Egypt from 51 to 30 BC, and its last active ruler. A member of the Ptolemaic dynasty, she was a descendant of its founder Ptolemy I Soter, a Macedonian Greek general and companion of Alexander the Great. After the death of Cleopatra, Egypt became a province of the Roman Empire, marking the end of the last Hellenistic-period state in the Mediterranean and of the age that had lasted since the reign of Alexander. Her first language was Koine Greek and she is the only known Ptolemaic ruler to learn the Egyptian language.","extract_html":"<p><b>Cleopatra VII Thea Philopator</b> was Queen of the Ptolemaic Kingdom of Egypt from 51 to 30 BC, and its last active ruler. A member of the Ptolemaic dynasty, she was a descendant of its founder Ptolemy I Soter, a Macedonian Greek general and companion of Alexander the Great. After the death of Cleopatra, Egypt became a province of the Roman Empire, marking the end of the last Hellenistic-period state in the Mediterranean and of the age that had lasted since the reign of Alexander. Her first language was Koine Greek and she is the only known Ptolemaic ruler to learn the Egyptian language.</p>","normalizedtitle":"Cleopatra"},{"views":147921,"rank":21,"view_history":[{"date":"2023-10-29Z","views":155726},{"date":"2023-10-30Z","views":38972},{"date":"2023-10-31Z","views":22740},{"date":"2023-11-01Z","views":24909},{"date":"2023-11-02Z","views":147921}],"type":"standard","title":"India_national_cricket_team","displaytitle":"<span class=\"mw-page-title-main\">India national cricket team</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q1143793","titles":{"canonical":"India_national_cricket_team","normalized":"India national cricket team","display":"<span class=\"mw-page-title-main\">India national cricket team</span>"},"pageid":407754,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/thumb/4/41/Flag_of_India.svg/320px-Flag_of_India.svg.png","width"