ional cricket team. He currently represents Royal Challengers Bangalore in the IPL and Delhi in domestic cricket. Kohli is widely regarded as one of the greatest batsmen in the history of the sport. In 2020, the International Cricket Council named him the male cricketer of the decade. Kohli has also contributed to India's successes, captaining the team from 2014 to 2022, and winning the 2011 World Cup and the 2013 Champions trophy. He is among the only four Indian cricketers who have played over 500 matches for India. Kohli is the fourth-highest run-scorer in international cricket and stands second in the list of cricketers by number of international centuries scored.</p>","normalizedtitle":"Virat Kohli"},{"views":109713,"rank":30,"view_history":[{"date":"2023-10-29Z","views":209724},{"date":"2023-10-30Z","views":163655},{"date":"2023-10-31Z","views":120333},{"date":"2023-11-01Z","views":118930},{"date":"2023-11-02Z","views":109713}],"type":"standard","title":"Killers_of_the_Flower_Moon_(film)","displaytitle":"<i>Killers of the Flower Moon</i> (film)","namespace":{"id":0,"text":""},"wikibase_item":"Q66316924","titles":{"canonical":"Killers_of_the_Flower_Moon_(film)","normalized":"Killers of the Flower Moon (film)","display":"<i>Killers of the Flower Moon</i> (film)"},"pageid":53852886,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/8/88/Killers_of_the_Flower_Moon_film_poster.jpg","width":258,"height":387},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/en/8/88/Killers_of_the_Flower_Moon_film_poster.jpg","width":258,"height":387},"lang":"en","dir":"ltr","revision":"1183222494","tid":"ecc3a0f0-79d6-11ee-b839-e5af855224dc","timestamp":"2023-11-02T23:24:05Z","description":"2023 film by Martin Scorsese","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Killers_of_the_Flower_Moon_(film)","revisions":"https://en.wikipedia.org/wiki/Killers_of_the_Flower_Moon_(film)?action=history","edit":"https:/