le":"State of Palestine"},{"views":84088,"rank":38,"view_history":[{"date":"2023-10-29Z","views":15570},{"date":"2023-10-30Z","views":9468},{"date":"2023-10-31Z","views":14601},{"date":"2023-11-01Z","views":27242},{"date":"2023-11-02Z","views":84088}],"type":"standard","title":"List_of_World_Series_champions","displaytitle":"<span class=\"mw-page-title-main\">List of World Series champions</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q862958","titles":{"canonical":"List_of_World_Series_champions","normalized":"List of World Series champions","display":"<span class=\"mw-page-title-main\">List of World Series champions</span>"},"pageid":7599168,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/4/49/1903_World_Series_-_Boston_Americans.jpg/320px-1903_World_Series_-_Boston_Americans.jpg","width":320,"height":177},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/4/49/1903_World_Series_-_Boston_Americans.jpg","width":1069,"height":592},"lang":"en","dir":"ltr","revision":"1183279198","tid":"262fa040-7a28-11ee-b367-4fe5137f5f86","timestamp":"2023-11-03T09:05:31Z","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/List_of_World_Series_champions","revisions":"https://en.wikipedia.org/wiki/List_of_World_Series_champions?action=history","edit":"https://en.wikipedia.org/wiki/List_of_World_Series_champions?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:List_of_World_Series_champions"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/List_of_World_Series_champions","revisions":"https://en.m.wikipedia.org/wiki/Special:History/List_of_World_Series_champions","edit":"https://en.m.wikipedia.org/wiki/List_of_World_Series_champions?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:List_of_World_Series_champions"}},"extract":"The World Series is the annual championship series of Major League Baseball (MLB) and concludes the MLB postseason. First played in 1903, the World Series championship is a best-of-seven playoff and is a contest between the champions of baseball's National League (NL) and American League (AL). Often referred to as the \"Fall Classic\", the modern World Series has been played every year since 1903 with two exceptions: in 1904, when the NL champion New York Giants declined to play the AL champion Boston Americans; and in 1994, when the series was canceled due to the players' strike.The best-of-seven style has been the format of all World Series except in 1903, 1919, 1920, 1921, when the winner was determined through a best-of-nine playoff. Although the large majority of contests have been played entirely during the month of October, a small number of Series have also had games played during September and November. The Series-winning team is awarded the Commissioner's Trophy. Players, coaches and others associated with the team are generally given World Series rings to commemorate their victory; however, they have received other items such as pocket watches and medallions in the past. The winning team is traditionally invited to the White House to meet the President of the United States.","extract_html":"<p>The World Series is the annual championship series of Major League Baseball (MLB) and concludes the MLB postseason. First played in 1903, the World Series championship is a best-of-seven playoff and is a contest between the champions of baseball's National League (NL) and American League (AL). Often referred to as the \"Fall Classic\", the modern World Series has been played every year since 1903 with two exceptions: in 1904, when the NL champion New York Giants declined to play the AL champion Boston Americans; and in 1994, when the series was canceled due to the players' strike.The best-of-seven style has been the format of all World Series except in 1903, 1919, 1920, 1921, when the winner was determined through a best-of-nine playoff. Although the large majority of contests have been played entirely during the month of October, a small number of Series have also had games played during September and November. The Series-winning team is awarded the Commissioner's Trophy. Players, coaches and others associated with the team are generally given World Series rings to commemorate their victory; however, they have received other items such as pocket watches and medallions in the past. The winning team is traditionally invited to the White House to meet the President of the United States.</p>","normalizedtitle":"List of World Series champions"},{"views":84042,"rank":39,"view_history":[{"date":"2023-10-29Z","views":22611},{"date":"2023-10-30Z","views":13966},{"date":"2023-10-31Z","views":18261},{"date":"2023-11-01Z","views":23815},{"date":"2023-11-02Z","views":84042}],"type":"standard","title":"All_the_Light_We_Cannot_See","displaytitle":"<i>All the Light We Cannot See</i>","namespace":{"id":0,"text":""},"wikibase_item":"Q18109559","titles":{"canonical":"All_the_Light_We_Cannot_See","normalized":"All the Light We Cannot See","display":"<i>All the Light We Cannot See</i>"},"pageid":43853567,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/2/22/All_the_Light_We_Cannot_See_%28Doerr_novel%29.jpg","width":260,"height":390},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/en/2/22/All_the_Light_We_Cannot_See_%28Doerr_novel%29.jpg","width":260,"height":390},"lang":"en","dir":"ltr","revision":"1183251601","tid":"a0496940-79f8-11ee-b5d4-8d37f3f36e2e","timestamp":"2023-11-03T03:25:21Z","description":"2014 novel by Anthony Doerr","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/All_the_Light_We_Cannot_See","revisions":"https://en.wikipedia.org/wiki/All_the_Light_We_Cannot_See?action=history","edit":"https://en.wikipedia.org/wiki/All_the_Light_We_Cannot_See?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:All_the_Light_We_Cannot_See"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/All_the_Light_We_Cannot_See","revisions":"http