FIA) as the highest class of international rallying. Teams and crews compete for the World Rally Championships for Drivers, Co-drivers and Manufacturers. Crews are free to compete in cars complying with Groups Rally1 to Rally5 regulations; however, only manufacturers competing with Rally1 cars homologated are eligible to score points in the manufacturers' championship. The championship began in January 2023 with the Monte Carlo Rally and is set to conclude in November 2023 with the Rally Japan. The series is supported by the World Rally Championship-2 and World Rally Championship-3 categories at every round of the championship and by the Junior World Rally Championship at selected events.","extract_html":"<p>The <b>2023 FIA World Rally Championship</b> is the fifty-first season of the World Rally Championship, a motorsport competition organised by the Fédération Internationale de l'Automobile (FIA) as the highest class of international rallying. Teams and crews compete for the World Rally Championships for Drivers, Co-drivers and Manufacturers. Crews are free to compete in cars complying with Groups Rally1 to Rally5 regulations; however, only manufacturers competing with Rally1 cars homologated are eligible to score points in the manufacturers' championship. The championship began in January 2023 with the Monte Carlo Rally and is set to conclude in November 2023 with the Rally Japan. The series is supported by the World Rally Championship-2 and World Rally Championship-3 categories at every round of the championship and by the Junior World Rally Championship at selected events.</p>","normalizedtitle":"2023 World Rally Championship"},{"type":"standard","title":"Motorsport","displaytitle":"<span class=\"mw-page-title-main\">Motorsport</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q5367","titles":{"canonical":"Motorsport","normalized":"Motorsport","display":"<span class=\"mw-page-title-main\">Motorsport</span>"},"pageid":293861,"thumbnail":{"source":"https://