},"extract":"The 2023 Rugby World Cup final was a rugby union match played on 28 October 2023 at the Stade de France in Saint-Denis, France. It marked the culmination of the 2023 Rugby World Cup and was played between New Zealand and South Africa, with the latter winning by a single point to claim their fourth Webb Ellis Cup, becoming the first nation to do so.","extract_html":"<p>The <b>2023 Rugby World Cup final</b> was a rugby union match played on 28 October 2023 at the Stade de France in Saint-Denis, France. It marked the culmination of the 2023 Rugby World Cup and was played between New Zealand and South Africa, with the latter winning by a single point to claim their fourth Webb Ellis Cup, becoming the first nation to do so.</p>","normalizedtitle":"2023 Rugby World Cup final"},{"type":"standard","title":"Rugby_union","displaytitle":"<span class=\"mw-page-title-main\">Rugby union</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q5849","titles":{"canonical":"Rugby_union","normalized":"Rugby union","display":"<span class=\"mw-page-title-main\">Rugby union</span>"},"pageid":25405,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b7/New_Zealand_vs_South_Africa_2006_Tri_Nations_Line_Out.JPG/320px-New_Zealand_vs_South_Africa_2006_Tri_Nations_Line_Out.JPG","width":320,"height":213},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/b/b7/New_Zealand_vs_South_Africa_2006_Tri_Nations_Line_Out.JPG","width":3008,"height":2000},"lang":"en","dir":"ltr","revision":"1183265267","tid":"e04d1430-7a0f-11ee-9735-c31662d5972c","timestamp":"2023-11-03T06:11:40Z","description":"Team sport, code of rugby football","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Rugby_union","revisions":"https://en.wikipedia.org/wiki/Rugby_union?action=history","edit":"https://en.wikipedia.org/wiki/Rugby_union?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Rugby_union"},"mobile":{"page":"ht