rugby_union_team.svg.png","width":240,"height":205},"lang":"en","dir":"ltr","revision":"1183282013","tid":"b0297cd0-7a2d-11ee-b863-e5abd9f08761","timestamp":"2023-11-03T09:45:05Z","description":"National sports team","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/South_Africa_national_rugby_union_team","revisions":"https://en.wikipedia.org/wiki/South_Africa_national_rugby_union_team?action=history","edit":"https://en.wikipedia.org/wiki/South_Africa_national_rugby_union_team?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:South_Africa_national_rugby_union_team"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/South_Africa_national_rugby_union_team","revisions":"https://en.m.wikipedia.org/wiki/Special:History/South_Africa_national_rugby_union_team","edit":"https://en.m.wikipedia.org/wiki/South_Africa_national_rugby_union_team?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:South_Africa_national_rugby_union_team"}},"extract":"The South Africa national rugby union team, commonly known as the Springboks, is the country's national team governed by the South African Rugby Union. The Springboks play in green and gold jerseys with white shorts. Their emblem is a native antelope, the Springbok, which is the national animal of South Africa. The team has been representing South African Rugby Union in international rugby union since 30 July 1891, when they played their first test match against a British Isles touring team. They are currently the number one ranked rugby team in the world and the reigning World Champions, having won the World Cup on a record four occasions. They are also the second nation to win the World Cup consecutively.","extract_html":"<p>The <b>South Africa national rugby union team</b>, commonly known as the <b>Springboks</b>, is the country's national team governed by the South African Rugby Union. The Springboks play in green and gold jerseys with white shorts. Their emblem is a native antelope, the Springbok, which is the national animal of South Africa. The team has been representing South African Rugby Union in international rugby union since 30 July 1891, when they played their first test match against a British Isles touring team. They are currently the number one ranked rugby team in the world and the reigning World Champions, having won the World Cup on a record four occasions. They are also the second nation to win the World Cup consecutively.</p>","normalizedtitle":"South Africa national rugby union team"},{"type":"standard","title":"New_Zealand_national_rugby_union_team","displaytitle":"<span class=\"mw-page-title-main\">New Zealand national rugby union team</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q55801","titles":{"canonical":"New_Zealand_national_rugby_union_team","normalized":"New Zealand national rugby union team","display":"<span class=\"mw-page-title-main\">New Zealand national rugby union team</span>"},"pageid":154957,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/thumb/f/fb/All_Blacks_logo.svg/320px-All_Blacks_logo.svg.png","width":320,"height":237},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/en/thumb/f/fb/All_Blacks_logo.svg/368px-All_Blacks_logo.svg.png","width":368,"height":272},"lang":"en","dir":"ltr","revision":"1182877320","tid":"14d1ea20-7842-11ee-992c-b74ca0394ef2","timestamp":"2023-10-31T23:05:56Z","description":"Men's rugby union team of New Zealand","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/New_Zealand_national_rugby_union_team","revisions":"https://en.wikipedia.org/wiki/New_Zealand_national_rugby_union_team?action=history","edit":"https://en.wikipedia.org/wiki/New_Zealand_national_rugby_union_team?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:New_Zealand_national_rugby_union_team"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/New_Zealand_national_rugby_union_team","revisions":"https://en.m.wikipedia.org/wiki/Special:History/New_Zealand_national_rugby_union_team","edit":"https://en.m.wikipedia.org/wiki/New_Zealand_national_rugby_union_team?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:New_Zealand_national_rugby_union_team"}},"extract":"The New Zealand national rugby union team, commonly known as the All Blacks, represents New Zealand in men's international rugby union, which is considered the country's national sport. Famed for their international success, the All Blacks have often been regarded as the most successful sports team in history.","extract_html":"<p>The <b>New Zealand national rugby union team</b>, commonly known as the <b>All Blacks</b>, represents New Zealand in men's international rugby union, which is considered the country's national sport. Famed for their international success, the All Blacks have often been regarded as the most successful sports team in history.</p>","normalizedtitle":"New Zealand national rugby union team"}],"story":"<!--Oct 28-->In <a rel=\"mw:WikiLink\" href=\"./Rugby_union\" title=\"Rugby union\" id=\"mwFA\">rugby union</a>, <a rel=\"mw:WikiLink\" href=\"./South_Africa_national_rugby_union_team\" title=\"South Africa national rugby union team\" id=\"mwFQ\">South Africa</a> beat <a rel=\"mw:WikiLink\" href=\"./New_Zealand_national_rugby_union_team\" title=\"New Zealand national rugby union team\" id=\"mwFg\">New Zealand</a> in <b id=\"mwFw\"><a rel=\"mw:WikiLink\" href=\"./2023_Rugby_World_Cup_final\" title=\"2023 Rugby World Cup final\" id=\"mwGA\">the World Cup final</a></b>."},{"links":[{"type":"standard","title":"Kostenko_mine_disaster","displaytitle":"<span class=\"mw-page-title-main\">Kostenko mine disaster</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q123224458","titles":{"canonical":"Kostenko_mine_disaster","normalized":"Kostenko mine disaster","display":"<span class=\"mw-page-title-main\">Kostenko mine disaster</span>"},"pageid":75167773,"lang":"en","dir":"ltr","revision":"1183290861","tid":"4cd618f0-7a3c-11ee-a6f0-4d0c210c8070","timestamp":"2023-11-03T11:29:48Z","description":"2023 coal mining disaster in Karaganda, Kazakhstan","description_source":"local","coordinates":{"lat":49.86,"lon":73.115},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Kostenko_mine_disaster","revisions":"https://en.wikipedia.org/wiki/Kostenko_mine_disaster?action=history","edit":"https://en.wikipedia.org/wiki/Kostenko_mine_disaster?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Kostenko_mine_disaster"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Kostenko_mine_disaster","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Kostenko_mine_disaster","edit":"https://en.m.wikipedia.org/wiki/Kostenko_mine_disaster?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Kostenko_mine_disaster"}},"extract":"On the morning of 28 October 2023, a fire started at the Kostenko mine in the Karaganda Region of Kazakhstan. The fire killed 46 miners. The fire was presumably caused by a methane gas explosion underground. The President of Kazakhstan, Kassym-Jomart Tokayev, ordered the termination of all investment with the company ArcelorMittal Temirtau, which owns the mine, and 29 October was declared a national day of mourning in Kazakhstan.","extract_html":"<p>On the morning of 28 October 2023, a fire started at the Kostenko mine in the Karaganda Region of Kazakhstan. The fire killed 46 miners. The fire was presumably caused by a methane gas explosion underground. The President of Kazakhstan, Kassym-Jomart Tokayev, ordered the termination of all investment with the company ArcelorMittal Temirtau, which owns the mine, and 29 October was declared a national day of mourning in Kazakhstan.</p>","normalizedtitle":"Kostenko mine disaster"},{"type":"standard","title":"Karaganda_Region","displaytitle":"<span class=\"mw-page-title-main\">Karaganda Region</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q485429","titles":{"canonical":"Karaganda_Region","normalized":"Karaganda Region","display":"<span class=\"mw-page-title-main\">Karaganda Region</span>"},"pageid":13226356,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/c/c4/%D0%92%D0%B8%D0%B4_%D0%91%D0%B5%D0%BA%D1%82%D0%B0%D1%83-%D0%90%D1%82%D0%B0.png/320px-%D0%92%D0%B8%D0%B4_%D0%91%D0%B5%D0%BA%D1%82%D0%B0%D1%83-%D0%90%D1%82%D0%B0.png","width":320,"height":213},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%D0%92%D0%B8%D0%B4_%D0%91%D0%B5%D0%BA%D1%82%D0%B0%D1%83-%D0%90%D1%82%D0%B0.png","width":1000,"height":667},"lang":"en","dir":"ltr","revision":"1182954076","tid":"89a87250-78ac-11ee-9e6b-f97a8bbc337f","timestamp":"2023-11-01T11:48:09Z","description":"Region of Kazakhstan","description_source":"local","coordinates":{"lat":48,"lon":71},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Karaganda_Region","revisions":"https://en.wikipedia.org/wiki/Karaganda_Region?action=history","edit":"https://en.wikipedia.org/wiki/Karaganda_Region?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Karaganda_Region"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Karaganda_Region","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Karaganda_Region","edit":"https://en.m.wikipedia.org/wiki/Karaganda_Region?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Karaganda_Region"}},"extract":"Karaganda Region, also spelled Qaraghandy Region, is a region of Kazakhstan. Its capital is Karaganda.","extract_html":"<p><b>Karaganda Region</b>, also spelled <b>Qaraghandy Region</b>, is a region of Kazakhstan. Its capital is Karaganda.</p>","normalizedtitle":"Karaganda Region"}],"story":"<!--Oct 28--><b id=\"mwGg\"><a rel=\"mw:WikiLink\" href=\"./Kostenko_mine_disaster\" title=\"Kostenko mine disaster\" id=\"mwGw\">A coal mine fire</a></b> in <a rel=\"mw:WikiLink\" href=\"./Karaganda_Region\" title=\"Karaganda Region\" id=\"mwHA\">Karaganda Region</a>, Kazakhstan, kills 46 people."}],"onthisday":[{"text":"Abdullah Çatlı, a leader of the ultra-nationalist Grey Wolves, was killed in a car crash near Susurluk, Turkey, sparking a scandal that exposed the depth of the state's complicity in organized crime.","pages":[{"type":"standard","title":"Abdullah_Çatlı","displaytitle":"<span class=\"mw-page-title-main\">Abdullah Çatlı</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q317793","titles":{"canonical":"Abdullah_Çatlı","normalized":"Abdullah Çatlı","display":"<span class=\"mw-page-title-main\">Abdullah Çatlı</span>"},"pageid":2784657,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/d/d7/Abdullah_%C3%87atl%C4%B1.jpg","width":250,"height":338},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/en/d/d7/Abdullah_%C3%87atl%C4%B1.jpg","width":250,"height":338},"lang":"en","dir":"ltr","revision":"1177905558","tid":"e2af6880-67d7-11ee-bb2b-5dd862db0f34","timestamp":"2023-09-30T10:56:52Z","description":"Turkish secret government agent","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Abdullah_%C3%87atl%C4%B1","revisions":"https://en.wikipedia.org/wiki/Abdullah_%C3%87atl%C4%B1?action=history","edit":"https://en.wikipedia.org/wiki/Abdullah_%C3%87atl%C4%B1?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Abdullah_%C3%87atl%C4%B1"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Abdullah_%C3%87atl%C4%B1","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Abdullah_%C3%87atl%C4%B1","edit":"https://en.m.wikipedia.org/wiki/Abdullah_%C3%87atl%C4%B1?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Abdullah_%C3%87atl%C4%B1"}},"extract":"\nAbdullah Çatlı was a Turkish secret government agent, as well as a contract killer for the National Intelligence Organization (MİT). He led the Grey Wolves, the youth branch of the Nationalist Movement Party (MHP), during the 1970s. His death in the Susurluk car crash, while travelling in a car with state officials, revealed the depth of the state's complicity in organized crime in what became known as the Susurluk scandal. He was a hitman for the state, and was involved in the killings of suspected members of the Kurdistan Workers' Party (PKK) and the Armenian Secret Army for the Liberation of Armenia (ASALA).","extract_html":"<p>\n<b>Abdullah Çatlı</b> was a Turkish secret government agent, as well as a contract killer for the National Intelligence Organization (MİT). He led the Grey Wolves, the youth branch of the Nationalist Movement Party (MHP), during the 1970s. His death in the Susurluk car crash, while travelling in a car with state officials, revealed the depth of the state's complicity in organized crime in what became known as the Susurluk scandal. He was a hitman for the state, and was involved in the killings of suspected members of the Kurdistan Workers' Party (PKK) and the Armenian Secret Army for the Liberation of Armenia (ASALA).</p>","normalizedtitle":"Abdullah Çatlı"},{"type":"standard","title":"Grey_Wolves_(organization)","displaytitle":"<span class=\"mw-page-title-main\">Grey Wolves (organization)</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q1142831","titles":{"canonical":"Grey_Wolves_(organization)","normalized":"Grey Wolves (organization)","display":"<span class=\"mw-page-title-main\">Grey Wolves (organization)</span>"},"pageid":793932,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/thumb/d/dc/Grey_Wolves_Logo.svg/320px-Grey_Wolves_Logo.svg.png","width":320,"height":320},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/en/thumb/d/dc/Grey_Wolves_Logo.svg/278px-Grey_Wolves_Logo.svg.png","width":278,"height":278},"lang":"en","dir":"ltr","revision":"1182624224","tid":"1f5938a0-771a-11ee-b667-138a1f1aa90e","timestamp":"2023-10-30T11:47:28Z","description":"Turkish ultra-nationalist political organization","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Grey_Wolves_(organization)","revisions":"https://en.wikipedia.org/wiki/Grey_Wolves_(organization)?action=history","edit":"https://en.wikipedia.org/wiki/Grey_Wolves_(organization)?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Grey_Wolves_(organization)"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Grey_Wolves_(organization)","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Grey_Wolves_(organization)","edit":"https://en.m.wikipedia.org/wiki/Grey_Wolves_(organization)?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Grey_Wolves_(organization)"}},"extract":"The Grey Wolves, officially known by the short name Idealist Hearths, is a Turkish far-right paramilitary organization and political movement affiliated with the Nationalist Movement Party (MHP). Commonly described as ultra-nationalist, neo-fascist, Islamonationalist, and racist, it is a youth organization that has been characterized as the MHP's paramilitary or militant wing. Its members deny its political nature and claim it to be a cultural and educational foundation, as per its full official name: Idealist Clubs Educational and Cultural Foundation.","extract_html":"<p>The <b>Grey Wolves</b>, officially known by the short name <b>Idealist Hearths</b>, is a Turkish far-right paramilitary organization and political movement affiliated with the Nationalist Movement Party (MHP). Commonly described as ultra-nationalist, neo-fascist, Islamonationalist, and racist, it is a youth organization that has been characterized as the MHP's paramilitary or militant wing. Its members deny its political nature and claim it to be a cultural and educational foundation, as per its full official name: <b>Idealist Clubs Educational and Cultural Foundation</b>.</p>","normalizedtitle":"Grey Wolves (organization)"},{"type":"standard","title":"Susurluk","displaytitle":"<span class=\"mw-page-title-main\">Susurluk</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q1023133","titles":{"canonical":"Susurluk","normalized":"Susurluk","display":"<span class=\"mw-page-title-main\">Susurluk</span>"},"pageid":1815032,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1c/Bal%C4%B1kesir_location_Susurluk.svg/320px-Bal%C4%B1kesir_location_Susurluk.svg.png","width":320,"height":276},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1c/Bal%C4%B1kesir_location_Susurluk.svg/590px-Bal%C4%B1kesir_location_Susurluk.svg.png","width":590,"height":508},"lang":"en","dir":"ltr","revision":"1181965996","tid":"ee542220-73da-11ee-939c-93d9b5f2a5b4","timestamp":"2023-10-26T08:37:41Z","description":"District and municipality in Balıkesir, Turkey","description_source":"local","coordinates":{"lat":39.91388889,"lon":28.16027778},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Susurluk","revisions":"https://en.wikipedia.org/wiki/Susurluk?action=history","edit":"https://en.wikipedia.org/wiki/Susurluk?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Susurluk"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Susurluk","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Susurluk","edit":"https://en.m.wikipedia.org/wiki/Susurluk?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Susurluk"}},"extract":"Susurluk is a municipality and district of Balıkesir Province, Turkey. Its area is 652 km2, and its population is 37,724 (2022). It is famous for its production of soap and dairy products. \nThe highway from Istanbul to İzmir passes through Susurluk. In Turkey Susurluk is known for its 'tost' - a toasted cheese sandwich with tomato paste, and for its foamy ayran. The mayor is Nurettin Güney (İYİ).","extract_html":"<p><b>Susurluk</b> is a municipality and district of Balıkesir Province, Turkey. Its area is 652 km<sup>2</sup>, and its population is 37,724 (2022). It is famous for its production of soap and dairy products. \nThe highway from Istanbul to İzmir passes through Susurluk. In Turkey Susurluk is known for its 'tost' - a toasted cheese sandwich with tomato paste, and for its foamy ayran. The mayor is Nurettin Güney (İYİ).</p>","normalizedtitle":"Susurluk"},{"type":"standard","title":"Susurluk_scandal","displaytitle":"<span class=\"mw-page-title-main\">Susurluk scandal</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2825895","titles":{"canonical":"Susurluk_scandal","normalized":"Susurluk scandal","display":"<span class=\"mw-page-title-main\">Susurluk scandal</span>"},"pageid":10231243,"lang":"en","dir":"ltr","revision":"1181378846","tid":"b81a1730-7a3f-11ee-a778-e1c771b9d42e","timestamp":"2023-10-22T18:07:42Z","description":"Mid-1990s political scandal in Turkey","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Susurluk_scandal","revisions":"https://en.wikipedia.org/wiki/Susurluk_scandal?action=history","edit":"https://en.wikipedia.org/wiki/Susurluk_scandal?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Susurluk_scandal"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Susurluk_scandal","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Susurluk_scandal","edit":"https://en.m.wikipedia.org/wiki/Susurluk_scandal?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Susurluk_scandal"}},"extract":"The Susurluk scandal was a political scandal in Turkey that exposed a close relationship between the Turkish government, the ultra-nationalistic paramilitary Grey Wolves organization and the Turkish mafia. It took place during the peak of the Kurdish–Turkish conflict in the mid-1990s.","extract_html":"<p>The <b>Susurluk scandal</b> was a political scandal in Turkey that exposed a close relationship between the Turkish government, the ultra-nationalistic paramilitary Grey Wolves organization and the Turkish mafia. It took place during the peak of the Kurdish–Turkish conflict in the mid-1990s.</p>","normalizedtitle":"Susurluk scandal"}],"year":1996},{"text":"U.S. president Richard Nixon made a plea for support from the \"silent majority\", referring to those Americans who did not join in the large demonstrations against the Vietnam War at the time.","pages":[{"type":"standard","title":"Richard_Nixon","displaytitle":"<span class=\"mw-page-title-main\">Richard Nixon</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q9588","titles":{"canonical":"Richard_Nixon","normalized":"Richard Nixon","display":"<span class=\"mw-page-title-main\">Richard Nixon</span>"},"pageid":25473,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/2/2c/Richard_Nixon_presidential_portrait_%281%29.jpg/320px-Richard_Nixon_presidential_portrait_%281%29.jpg","width":320,"height":427},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Richard_Nixon_presidential_portrait_%281%29.jpg","width":2205,"height":2939},"lang":"en","dir":"ltr","revision":"1183215665","tid":"5ce35410-79ce-11ee-961e-955dd840d6ee","timestamp":"2023-11-02T22:22:37Z","description":"President of the United States from 1969 to 1974","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Richard_Nixon","revisions":"https://en.wikipedia.org/wiki/Richard_Nixon?action=history","edit":"https://en.wikipedia.org/wiki/Richard_Nixon?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Richard_Nixon"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Richard_Nixon","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Richard_Nixon","edit":"https://en.m.wikipedia.org/wiki/Richard_Nixon?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Richard_Nixon"}},"extract":"Richard Milhous Nixon was the 37th president of the United States, serving from 1969 to 1974. A lawyer and member of the Republican Party, he previously served as a representative and senator from California and was the 36th vice president from 1953 to 1961 under President Dwight D. Eisenhower. His five years in the White House saw reduction of U.S. involvement in the Vietnam War, détente with the Soviet Union and China, the Apollo 11 Moon landing, and the establishment of the Environmental Protection Agency and Occupational Safety and Health Administration. Nixon's second term ended early when he became the only U.S. president to resign from office, as a result of the Watergate scandal.","extract_html":"<p><b>Richard Milhous Nixon</b> was the 37th president of the United States, serving from 1969 to 1974. A lawyer and member of the Republican Party, he previously served as a representative and senator from California and was the 36th vice president from 1953 to 1961 under President Dwight D. Eisenhower. His five years in the White House saw reduction of U.S. involvement in the Vietnam War, <span><i>détente</i></span> with the Soviet Union and China, the Apollo 11 Moon landing, and the establishment of the Environmental Protection Agency and Occupational Safety and Health Administration. Nixon's second term ended early when he became the only U.S. president to resign from office, as a result of the Watergate scandal.</p>","normalizedtitle":"Richard Nixon"},{"type":"standard","title":"Silent_majority","displaytitle":"<span class=\"mw-page-title-main\">Silent majority</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2555361","titles":{"canonical":"Silent_majority","normalized":"Silent majority","display":"<span class=\"mw-page-title-main\">Silent majority</span>"},"pageid":88270,"lang":"en","dir":"ltr","revision":"1176412745","tid":"4da66970-7798-11ee-9f2d-67b365612516","timestamp":"2023-09-21T15:39:05Z","description":"Concept in politics","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Silent_majority","revisions":"https://en.wikipedia.org/wiki/Silent_majority?action=history","edit":"https://en.wikipedia.org/wiki/Silent_majority?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Silent_majority"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Silent_majority","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Silent_majority","edit":"https://en.m.wikipedia.org/wiki/Silent_majority?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Silent_majority"}},"extract":"The silent majority is an unspecified large group of people in a country or group who do not express their opinions publicly. The term was popularized by U.S. President Richard Nixon in a televised address on November 3, 1969, in which he said, \"And so tonight—to you, the great silent majority of my fellow Americans—I ask for your support.\" In this usage it referred to those Americans who did not join in the large demonstrations against the Vietnam War at the time, who did not join in the counterculture, and who did not participate in public discourse. Nixon, along with many others, saw this group of Middle Americans as being overshadowed in the media by the more vocal minority.","extract_html":"<p>The <b>silent majority</b> is an unspecified large group of people in a country or group who do not express their opinions publicly. The term was popularized by U.S. President Richard Nixon in a televised address on November 3, 1969, in which he said, \"And so tonight—to you, the great silent majority of my fellow Americans—I ask for your support.\" In this usage it referred to those Americans who did not join in the large demonstrations against the Vietnam War at the time, who did not join in the counterculture, and who did not participate in public discourse. Nixon, along with many others, saw this group of Middle Americans as being overshadowed in the media by the more vocal minority.</p>","normalizedtitle":"Silent majority"},{"type":"standard","title":"Opposition_to_United_States_involvement_in_the_Vietnam_War","displaytitle":"<span class=\"mw-page-title-main\">Opposition to United States involvement in the Vietnam War</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q5254589","titles":{"canonical":"Opposition_to_United_States_involvement_in_the_Vietnam_War","normalized":"Opposition to United States involvement in the Vietnam War","display":"<span class=\"mw-page-title-main\">Opposition to United States involvement in the Vietnam War</span>"},"pageid":1854610,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/03/Vietnamdem.jpg/320px-Vietnamdem.jpg","width":320,"height":318},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/03/Vietnamdem.jpg","width":2400,"height":2384},"lang":"en","dir":"ltr","revision":"1183199397","tid":"8ea57f40-79bb-11ee-8f43-01071fad6853","timestamp":"2023-11-02T20:08:08Z","description":"1964–1973 anti-war movement","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Opposition_to_United_States_involvement_in_the_Vietnam_War","revisions":"https://en.wikipedia.org/wiki/Opposition_to_United_States_involvement_in_the_Vietnam_War?action=history","edit":"https://en.wikipedia.org/wiki/Opposition_to_United_States_involvement_in_the_Vietnam_War?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Opposition_to_United_States_involvement_in_the_Vietnam_War"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Opposition_to_United_States_involvement_in_the_Vietnam_War","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Opposition_to_United_States_involvement_in_the_Vietnam_War","edit":"https://en.m.wikipedia.org/wiki/Opposition_to_United_States_involvement_in_the_Vietnam_War?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Opposition_to_United_States_involvement_in_the_Vietnam_War"}},"extract":"Opposition to United States involvement in the Vietnam War began with demonstrations in 1965 against the escalating role of the United States in the Vietnam War and grew into a broad social movement over the ensuing several years. This movement informed and helped shape the vigorous and polarizing debate, primarily in the United States, during the second half of the 1960s and early 1970s on how to end the Vietnam War.","extract_html":"<p><b>Opposition to United States involvement in the Vietnam War</b> began with demonstrations in 1965 against the escalating role of the United States in the Vietnam War and grew into a broad social movement over the ensuing several years. This movement informed and helped shape the vigorous and polarizing debate, primarily in the United States, during the second half of the 1960s and early 1970s on how to end the Vietnam War.</p>","normalizedtitle":"Opposition to United States involvement in the Vietnam War"}],"year":1969},{"text":"The Soviet Union launched Sputnik 2, carrying the space dog Laika as the first living creature to enter orbit around Earth.","pages":[{"type":"standard","title":"Sputnik_2","displaytitle":"<span class=\"mw-page-title-main\">Sputnik 2</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q190555","titles":{"canonical":"Sputnik_2","normalized":"Sputnik 2","display":"<span class=\"mw-page-title-main\">Sputnik 2</span>"},"pageid":81978,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/3/33/Laika_ac_Sputnik_2_Replica_%286995685051%29.jpg/320px-Laika_ac_Sputnik_2_Replica_%286995685051%29.jpg","width":320,"height":480},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/3/33/Laika_ac_Sputnik_2_Replica_%286995685051%29.jpg","width":3456,"height":5184},"lang":"en","dir":"ltr","revision":"1183265364","tid":"0e1f45e0-7a10-11ee-8ac7-0516d150d245","timestamp":"2023-11-03T06:13:04Z","description":"Second spacecraft launched into Earth orbit (1957)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Sputnik_2","revisions":"https://en.wikipedia.org/wiki/Sputnik_2?action=history","edit":"https://en.wikipedia.org/wiki/Sputnik_2?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Sputnik_2"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Sputnik_2","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Sputnik_2","edit":"https://en.m.wikipedia.org/wiki/Sputnik_2?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Sputnik_2"}},"extract":"Sputnik 2, or Prosteyshiy Sputnik 2, launched on 3 November 1957, was the second spacecraft launched into Earth orbit, and the first to carry an animal into orbit, a Soviet space dog named Laika.","extract_html":"<p><b>Sputnik 2</b>, or <b>Prosteyshiy Sputnik 2</b>, launched on 3 November 1957, was the second spacecraft launched into Earth orbit, and the first to carry an animal into orbit, a Soviet space dog named Laika.</p>","normalizedtitle":"Sputnik 2"},{"type":"standard","title":"Soviet_space_dogs","displaytitle":"<span class=\"mw-page-title-main\">Soviet space dogs</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q327132","titles":{"canonical":"Soviet_space_dogs","normalized":"Soviet space dogs","display":"<span class=\"mw-page-title-main\">Soviet space dogs</span>"},"pageid":746647,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/6/64/Russian_space_dog_box.jpg/320px-Russian_space_dog_box.jpg","width":320,"height":402},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/6/64/Russian_space_dog_box.jpg","width":637,"height":800},"lang":"en","dir":"ltr","revision":"1175886144","tid":"ed623ed0-79be-11ee-a6cb-b1517952f798","timestamp":"2023-09-18T02:17:24Z","description":"Soviet-era program that sent dogs to space","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Soviet_space_dogs","revisions":"https://en.wikipedia.org/wiki/Soviet_space_dogs?action=history","edit":"https://en.wikipedia.org/wiki/Soviet_space_dogs?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Soviet_space_dogs"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Soviet_space_dogs","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Soviet_space_dogs","edit":"https://en.m.wikipedia.org/wiki/Soviet_space_dogs?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Soviet_space_dogs"}},"extract":"During the 1950s and 1960s the Soviet space program used dogs for sub-orbital and orbital space flights to determine whether human spaceflight was feasible. These dogs were surgically modified to provide the necessary information for human survival in space. The Soviet space program typically used female dogs due to their anatomical compatibility with the spacesuit. Similarly, they used mix-breed dogs due to their apparent hardiness.","extract_html":"<p>During the 1950s and 1960s the Soviet space program used dogs for sub-orbital and orbital space flights to determine whether human spaceflight was feasible. These dogs were surgically modified to provide the necessary information for human survival in space. The Soviet space program typically used female dogs due to their anatomical compatibility with the spacesuit. Similarly, they used mix-breed dogs due to their apparent hardiness.</p>","normalizedtitle":"Soviet space dogs"},{"type":"standard","title":"Laika","displaytitle":"<span class=\"mw-page-title-main\">Laika</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q53662","titles":{"canonical":"Laika","normalized":"Laika","display":"<span class=\"mw-page-title-main\">Laika</span>"},"pageid":18739,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/thumb/7/71/Laika_%28Soviet_dog%29.jpg/320px-Laika_%28Soviet_dog%29.jpg","width":320,"height":241},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/en/7/71/Laika_%28Soviet_dog%29.jpg","width":365,"height":275},"lang":"en","dir":"ltr","revision":"1183263918","tid":"54a3d290-7a0d-11ee-a7a1-3d40ba726de4","timestamp":"2023-11-03T05:53:33Z","description":"Soviet dog, first animal to orbit Earth (1957)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Laika","revisions":"https://en.wikipedia.org/wiki/Laika?action=history","edit":"https://en.wikipedia.org/wiki/Laika?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Laika"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Laika","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Laika","edit":"https://en.m.wikipedia.org/wiki/Laika?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Laika"}},"extract":"Laika was a Soviet space dog who was one of the first animals in space and the first to orbit the Earth. A stray mongrel from the streets of Moscow, she flew aboard the Sputnik 2 spacecraft, launched into low orbit on 3 November 1957. As the technology to de-orbit had not yet been developed, Laika's survival was never expected. She died of overheating hours into the flight, on the craft's fourth orbit.","extract_html":"<p><b>Laika</b> was a Soviet space dog who was one of the first animals in space and the first to orbit the Earth. A stray mongrel from the streets of Moscow, she flew aboard the Sputnik 2 spacecraft, launched into low orbit on 3 November 1957. As the technology to de-orbit had not yet been developed, Laika's survival was never expected. She died of overheating hours into the flight, on the craft's fourth orbit.</p>","normalizedtitle":"Laika"}],"year":1957},{"text":"Suez Crisis: During an invasion of the Gaza Strip, Israeli soldiers shot and killed hundreds of Palestinian refugees and local inhabitants in Khan Yunis.","pages":[{"type":"standard","title":"Suez_Crisis","displaytitle":"<span class=\"mw-page-title-main\">Suez Crisis</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q49101","titles":{"canonical":"Suez_Crisis","normalized":"Suez Crisis","display":"<span class=\"mw-page-title-main\">Suez Crisis</span>"},"pageid":58568,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1d/Tanks_Destroyed_Sinai.jpg/320px-Tanks_Destroyed_Sinai.jpg","width":320,"height":204},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Tanks_Destroyed_Sinai.jpg","width":1566,"height":1000},"lang":"en","dir":"ltr","revision":"1183104328","tid":"db4760a0-7940-11ee-a5c0-ff1040f0f883","timestamp":"2023-11-02T05:29:49Z","description":"1956 British–French–Israeli invasion of Egypt","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Suez_Crisis","revisions":"https://en.wikipedia.org/wiki/Suez_Crisis?action=history","edit":"https://en.wikipedia.org/wiki/Suez_Crisis?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Suez_Crisis"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Suez_Crisis","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Suez_Crisis","edit":"https://en.m.wikipedia.org/wiki/Suez_Crisis?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Suez_Crisis"}},"extract":"The Suez Crisis, or the Second Arab–Israeli war, also called the Tripartite Aggression in the Arab world and the Sinai War in Israel, was an invasion of Egypt and the Gaza Strip in late 1956 by Israel, followed by the United Kingdom and France. The aims were to regain control of the Suez Canal for the Western powers and to remove Egyptian president Gamal Abdel Nasser, who had just nationalised the foreign-owned Suez Canal Company, which administered the canal. Israel's primary objective was to re-open the blocked Straits of Tiran. After the fighting had started, political pressure from the United States, the Soviet Union, and the United Nations led to a withdrawal by the three invaders. The episode humiliated the United Kingdom and France and strengthened Nasser.","extract_html":"<p>The <b>Suez Crisis</b>, or the <b>Second Arab–Israeli war</b>, also called the <b>Tripartite Aggression</b> in the Arab world and the <b>Sinai War</b> in Israel, was an invasion of Egypt and the Gaza Strip in late 1956 by Israel, followed by the United Kingdom and France. The aims were to regain control of the Suez Canal for the Western powers and to remove Egyptian president Gamal Abdel Nasser, who had just nationalised the foreign-owned Suez Canal Company, which administered the canal. Israel's primary objective was to re-open the blocked Straits of Tiran. After the fighting had started, political pressure from the United States, the Soviet Union, and the United Nations led to a withdrawal by the three invaders. The episode humiliated the United Kingdom and France and strengthened Nasser.</p>","normalizedtitle":"Suez Crisis"},{"type":"standard","title":"Gaza_Strip","displaytitle":"<span class=\"mw-page-title-main\">Gaza Strip</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q39760","titles":{"canonical":"Gaza_Strip","normalized":"Gaza Strip","display":"<span class=\"mw-page-title-main\">Gaza Strip</span>"},"pageid":12047,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/Flag_of_Palestine.svg/320px-Flag_of_Palestine.svg.png","width":320,"height":160},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/Flag_of_Palestine.svg/1200px-Flag_of_Palestine.svg.png","width":1200,"height":600},"lang":"en","dir":"ltr","revision":"1183294122","tid":"8e3ab8a0-7a41-11ee-a894-a90b0fe3c4e3","timestamp":"2023-11-03T12:07:19Z","description":"Self-governing Palestinian territory next to Egypt and Israel","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Gaza_Strip","revisions":"https://en.wikipedia.org/wiki/Gaza_Strip?action=history","edit":"https://en.wikipedia.org/wiki/Gaza_Strip?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Gaza_Strip"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Gaza_Strip","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Gaza_Strip","edit":"https://en.m.wikipedia.org/wiki/Gaza_Strip?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Gaza_Strip"}},"extract":"The Gaza Strip, or simply Gaza, is the smaller of the two Palestinian territories. Situated on the eastern coast of the Mediterranean Sea, the territory is bordered by Egypt on the southwest and Israel on the east and north. Gaza, along with the West Bank, have been under Israeli military occupation since 1967, which Israel disputes after its 2005 disengagement from the Strip.","extract_html":"<p>The <b>Gaza Strip</b>, or simply <b>Gaza</b>, is the smaller of the two Palestinian territories. Situated on the eastern coast of the Mediterranean Sea, the territory is bordered by Egypt on the southwest and Israel on the east and north. Gaza, along with the West Bank, have been under Israeli military occupation since 1967, which Israel disputes after its 2005 disengagement from the Strip.</p>","normalizedtitle":"Gaza Strip"},{"type":"standard","title":"Khan_Yunis_massacre","displaytitle":"<span class=\"mw-page-title-main\">Khan Yunis massacre</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q12241913","titles":{"canonical":"Khan_Yunis_massacre","normalized":"Khan Yunis massacre","display":"<span class=\"mw-page-title-main\">Khan Yunis massacre</span>"},"pageid":40346044,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/7/77/Khan_Yunis-1930s.jpg/320px-Khan_Yunis-1930s.jpg","width":320,"height":171},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/7/77/Khan_Yunis-1930s.jpg","width":604,"height":322},"lang":"en","dir":"ltr","revision":"1181797265","tid":"7fa8e140-730c-11ee-bdd4-3367d227f0f0","timestamp":"2023-10-25T07:59:59Z","description":"1956 mass killing of Palestinians by Israeli forces during the Suez Crisis","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Khan_Yunis_massacre","revisions":"https://en.wikipedia.org/wiki/Khan_Yunis_massacre?action=history","edit":"https://en.wikipedia.org/wiki/Khan_Yunis_massacre?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Khan_Yunis_massacre"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Khan_Yunis_massacre","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Khan_Yunis_massacre","edit":"https://en.m.wikipedia.org/wiki/Khan_Yunis_massacre?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Khan_Yunis_massacre"}},"extract":"The Khan Yunis massacre took place on 3 November 1956 perpetrated by the Israel Defense Forces in the Palestinian town of Khan Yunis and the nearby refugee camp of the same name in the Gaza Strip during the Suez Crisis.","extract_html":"<p>The <b>Khan Yunis massacre</b> took place on 3 November 1956 perpetrated by the Israel Defense Forces in the Palestinian town of Khan Yunis and the nearby refugee camp of the same name in the Gaza Strip during the Suez Crisis.</p>","normalizedtitle":"Khan Yunis massacre"},{"type":"standard","title":"Khan_Yunis","displaytitle":"<span class=\"mw-page-title-main\">Khan Yunis</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q309348","titles":{"canonical":"Khan_Yunis","normalized":"Khan Yunis","display":"<span class=\"mw-page-title-main\">Khan Yunis</span>"},"pageid":101330,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b3/Khan_Yunis_panorama.jpg/320px-Khan_Yunis_panorama.jpg","width":320,"height":213},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Khan_Yunis_panorama.jpg","width":960,"height":640},"lang":"en","dir":"ltr","revision":"1183077893","tid":"3c606a10-7920-11ee-835f-8fe2449391f8","timestamp":"2023-11-02T01:36:21Z","description":"City in Gaza, Palestine","description_source":"local","coordinates":{"lat":31.34444444,"lon":34.30305556},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Khan_Yunis","revisions":"https://en.wikipedia.org/wiki/Khan_Yunis?action=history","edit":"https://en.wikipedia.org/wiki/Khan_Yunis?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Khan_Yunis"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Khan_Yunis","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Khan_Yunis","edit":"https://en.m.wikipedia.org/wiki/Khan_Yunis?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Khan_Yunis"}},"extract":"Khan Yunis is a city in the southern Gaza Strip; it is the capital of the Khan Yunis Governorate of the State of Palestine. According to the Palestinian Central Bureau of Statistics, Khan Yunis had a population of 205,125 in 2017. Khan Yunis, which lies only 4 kilometers east of the Mediterranean Sea, has a semi-arid climate with temperature of 30 degrees Celsius maximum in summer and 10 degrees Celsius maximum in winter, with an annual rainfall of approximately 260 mm (10.2 in).","extract_html":"<p><b>Khan Yunis</b> is a city in the southern Gaza Strip; it is the capital of the Khan Yunis Governorate of the State of Palestine. According to the Palestinian Central Bureau of Statistics, Khan Yunis had a population of 205,125 in 2017. Khan Yunis, which lies only 4 kilometers east of the Mediterranean Sea, has a semi-arid climate with temperature of 30 degrees Celsius maximum in summer and 10 degrees Celsius maximum in winter, with an annual rainfall of approximately 260 mm (10.2 in).</p>","normalizedtitle":"Khan Yunis"}],"year":1956},{"text":"The first film featuring the giant monster known as Godzilla was released nationwide in Japan.","pages":[{"type":"standard","title":"Godzilla_(1954_film)","displaytitle":"<i>Godzilla</i> (1954 film)","namespace":{"id":0,"text":""},"wikibase_item":"Q860461","titles":{"canonical":"Godzilla_(1954_film)","normalized":"Godzilla (1954 film)","display":"<i>Godzilla</i> (1954 film)"},"pageid":12004,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Gojira_1954_Japanese_poster.jpg/320px-Gojira_1954_Japanese_poster.jpg","width":320,"height":450},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/9/95/Gojira_1954_Japanese_poster.jpg","width":2135,"height":3000},"lang":"en","dir":"ltr","revision":"1182225512","tid":"188aead0-751e-11ee-b87b-e395a96f2f98","timestamp":"2023-10-27T23:10:53Z","description":"Japanese monster film","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Godzilla_(1954_film)","revisions":"https://en.wikipedia.org/wiki/Godzilla_(1954_film)?action=history","edit":"https://en.wikipedia.org/wiki/Godzilla_(1954_film)?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Godzilla_(1954_film)"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Godzilla_(1954_film)","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Godzilla_(1954_film)","edit":"https://en.m.wikipedia.org/wiki/Godzilla_(1954_film)?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Godzilla_(1954_film)"}},"extract":"Godzilla  is a 1954 Japanese epic kaiju film directed and co-written by Ishirō Honda, with special effects by Eiji Tsuburaya. Produced and distributed by Toho Co., Ltd., it is the first film in the Godzilla franchise. The film stars Akira Takarada, Momoko Kōchi, Akihiko Hirata, and Takashi Shimura, with Haruo Nakajima and Katsumi Tezuka as Godzilla. In the film, Japan's authorities deal with the sudden appearance of a giant monster, whose attacks trigger fears of nuclear holocaust during post-war Japan.","extract_html":"<p><i><b>Godzilla</b></i><span style=\"font-weight:normal\"> </span> is a 1954 Japanese epic <i>kaiju</i> film directed and co-written by Ishirō Honda, with special effects by Eiji Tsuburaya. Produced and distributed by Toho Co., Ltd., it is the first film in the <span><i>Godzilla</i> franchise</span>. The film stars Akira Takarada, Momoko Kōchi, Akihiko Hirata, and Takashi Shimura, with Haruo Nakajima and Katsumi Tezuka as Godzilla. In the film, Japan's authorities deal with the sudden appearance of a giant monster, whose attacks trigger fears of nuclear holocaust during post-war Japan.</p>","normalizedtitle":"Godzilla (1954 film)"},{"type":"standard","title":"Kaiju","displaytitle":"<i>Kaiju</i>","namespace":{"id":0,"text":""},"wikibase_item":"Q1065444","titles":{"canonical":"Kaiju","normalized":"Kaiju","display":"<i>Kaiju</i>"},"pageid":64998,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/01/Gojira_1954_poster_3.jpg/320px-Gojira_1954_poster_3.jpg","width":320,"height":488},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/01/Gojira_1954_poster_3.jpg","width":2016,"height":3072},"lang":"en","dir":"ltr","revision":"1176309277","tid":"fefe6500-77a8-11ee-973c-bf5d37ca3cba","timestamp":"2023-09-20T21:44:19Z","description":"Japanese media genre","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Kaiju","revisions":"https://en.wikipedia.org/wiki/Kaiju?action=history","edit":"https://en.wikipedia.org/wiki/Kaiju?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Kaiju"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Kaiju","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Kaiju","edit":"https://en.m.wikipedia.org/wiki/Kaiju?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Kaiju"}},"extract":"Kaiju  is a Japanese term that is commonly associated with media involving giant monsters and monster movies. A subgenre of science fiction and fantasy, it was created by Eiji Tsuburaya and Ishirō Honda. The word can also refer to the giant monsters themselves, which are usually depicted attacking major cities and battling either the military or other monsters.","extract_html":"<p><i><b>Kaiju</b></i><span style=\"font-weight:normal\"> </span> is a Japanese term that is commonly associated with media involving giant monsters and monster movies. A subgenre of science fiction and fantasy, it was created by Eiji Tsuburaya and Ishirō Honda. The word can also refer to the giant monsters themselves, which are usually depicted attacking major cities and battling either the military or other monsters.</p>","normalizedtitle":"Kaiju"},{"type":"standard","title":"Godzilla","displaytitle":"<span class=\"mw-page-title-main\">Godzilla</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q6567","titles":{"canonical":"Godzilla","normalized":"Godzilla","display":"<span class=\"mw-page-title-main\">Godzilla</span>"},"pageid":11986,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1d/Godzilla_%281954%29.jpg/320px-Godzilla_%281954%29.jpg","width":320,"height":247},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Godzilla_%281954%29.jpg","width":2617,"height":2022},"lang":"en","dir":"ltr","revision":"1182836901","tid":"40611f90-7814-11ee-bbdf-19cf1778a9d3","timestamp":"2023-10-31T17:38:00Z","description":"Godzilla kaiju","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Godzilla","revisions":"https://en.wikipedia.org/wiki/Godzilla?action=history","edit":"https://en.wikipedia.org/wiki/Godzilla?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Godzilla"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Godzilla","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Godzilla","edit":"https://en.m.wikipedia.org/wiki/Godzilla?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Godzilla"}},"extract":"Godzilla  is a fictional monster, or kaiju, that debuted in the eponymous 1954 film, directed and co-written by Ishirō Honda. The character has since become an international pop culture icon, appearing in various media: 33 Japanese films produced by Toho Co., Ltd., five American films and numerous video games, novels, comic books and television shows. Godzilla has been dubbed the \"King of the Monsters\", an epithet first used in Godzilla, King of the Monsters! (1956), the American localization of the 1954 film.","extract_html":"<p><b>Godzilla</b><span style=\"font-weight:normal\"> </span> is a fictional monster, or <i>kaiju</i>, that debuted in the eponymous 1954 film, directed and co-written by Ishirō Honda. The character has since become an international pop culture icon, appearing in various media: 33 Japanese films produced by Toho Co., Ltd., five American films and numerous video games, novels, comic books and television shows. Godzilla has been dubbed the \"<b>King of the Monsters</b>\", an epithet first used in <i>Godzilla, King of the Monsters!</i> (1956), the American localization of the 1954 film.</p>","normalizedtitle":"Godzilla"}],"year":1954},{"text":"The Chicago Daily Tribune published the erroneous headline \"Dewey Defeats Truman\" (pictured) in its early morning edition shortly after incumbent U.S. president Harry S. Truman officially upset the heavily favored governor of New York Thomas Dewey in the presidential election.","pages":[{"type":"standard","title":"Chicago_Tribune","displaytitle":"<i>Chicago Tribune</i>","namespace":{"id":0,"text":""},"wikibase_item":"Q47596","titles":{"canonical":"Chicago_Tribune","normalized":"Chicago Tribune","display":"<i>Chicago Tribune</i>"},"pageid":60961,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/en/b/b3/Chicagotribunejune162009.png","width":226,"height":441},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/en/b/b3/Chicagotribunejune162009.png","width":226,"height":441},"lang":"en","dir":"ltr","revision":"1181823217","tid":"6fb87530-7333-11ee-a386-27432a774ac0","timestamp":"2023-10-25T12:38:35Z","description":"Major American newspaper, founded 1847","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Chicago_Tribune","revisions":"https://en.wikipedia.org/wiki/Chicago_Tribune?action=history","edit":"https://en.wikipedia.org/wiki/Chicago_Tribune?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Chicago_Tribune"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Chicago_Tribune","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Chicago_Tribune","edit":"https://en.m.wikipedia.org/wiki/Chicago_Tribune?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Chicago_Tribune"}},"extract":"The Chicago Tribune is a daily newspaper based in Chicago, Illinois, United States, owned by Tribune Publishing. Founded in 1847, and formerly self-styled as the \"World's Greatest Newspaper\", it remains the most-read daily newspaper in the Chicago metropolitan area and the Great Lakes region. In 2022, it had the seventh-highest circulation of any American newspaper.","extract_html":"<p>The <i><b>Chicago Tribune</b></i> is a daily newspaper based in Chicago, Illinois, United States, owned by Tribune Publishing. Founded in 1847, and formerly self-styled as the \"World's Greatest Newspaper\", it remains the most-read daily newspaper in the Chicago metropolitan area and the Great Lakes region. In 2022, it had the seventh-highest circulation of any American newspaper.</p>","normalizedtitle":"Chicago Tribune"},{"type":"standard","title":"Dewey_Defeats_Truman","displaytitle":"<span class=\"mw-page-title-main\">Dewey Defeats Truman</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q740421","titles":{"canonical":"Dewey_Defeats_Truman","normalized":"Dewey Defeats Truman","display":"<span class=\"mw-page-title-main\">Dewey Defeats Truman</span>"},"pageid":2026987,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Dewey_Defeats_Truman.jpg/320px-Dewey_Defeats_Truman.jpg","width":320,"height":246},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/09/Dewey_Defeats_Truman.jpg","width":3000,"height":2306},"lang":"en","dir":"ltr","revision":"1183270259","tid":"a80e9af0-7a17-11ee-b8e9-e9043fed950c","timestamp":"2023-11-03T07:07:30Z","description":"1948 incorrect American newspaper headline","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Dewey_Defeats_Truman","revisions":"https://en.wikipedia.org/wiki/Dewey_Defeats_Truman?action=history","edit":"https://en.wikipedia.org/wiki/Dewey_Defeats_Truman?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Dewey_Defeats_Truman"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Dewey_Defeats_Truman","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Dewey_Defeats_Truman","edit":"https://en.m.wikipedia.org/wiki/Dewey_Defeats_Truman?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Dewey_Defeats_Truman"}},"extract":"\"Dewey Defeats Truman\" was an incorrect banner headline on the front page of the Chicago Daily Tribune on November 3, 1948, the day after incumbent United States president Harry S. Truman won an upset victory over his opponent, Governor Thomas E. Dewey of New York, in the 1948 presidential election. It was famously held up by Truman at a stop at St. Louis Union Station following his successful election, smiling triumphantly at the error.","extract_html":"<p>\"<b>Dewey Defeats Truman</b>\" was an incorrect banner headline on the front page of the <i>Chicago Daily Tribune</i> on November 3, 1948, the day after incumbent United States president Harry S. Truman won an upset victory over his opponent, Governor Thomas E. Dewey of New York, in the 1948 presidential election. It was famously held up by Truman at a stop at St. Louis Union Station following his successful election, smiling triumphantly at the error.</p>","normalizedtitle":"Dewey Defeats Truman"},{"type":"standard","title":"Harry_S._Truman","displaytitle":"<span class=\"mw-page-title-main\">Harry S. Truman</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q11613","titles":{"canonical":"Harry_S._Truman","normalized":"Harry S. Truman","display":"<span class=\"mw-page-title-main\">Harry S. Truman</span>"},"pageid":3418303,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0b/TRUMAN_58-766-06_%28cropped%29.jpg/320px-TRUMAN_58-766-06_%28cropped%29.jpg","width":320,"height":432},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/0b/TRUMAN_58-766-06_%28cropped%29.jpg","width":900,"height":1215},"lang":"en","dir":"ltr","revision":"1183288186","tid":"31988360-7a38-11ee-a3b7-13ac93c84c03","timestamp":"2023-11-03T11:00:16Z","description":"President of the United States from 1945 to 1953","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Harry_S._Truman","revisions":"https://en.wikipedia.org/wiki/Harry_S._Truman?action=history","edit":"https://en.wikipedia.org/wiki/Harry_S._Truman?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Harry_S._Truman"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Harry_S._Truman","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Harry_S._Truman","edit":"https://en.m.wikipedia.org/wiki/Harry_S._Truman?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Harry_S._Truman"}},"extract":"Harry S. Truman was the 33rd president of the United States, serving from 1945 to 1953. A member of the Democratic Party, he previously served as a United States senator from Missouri from 1935 to 1945 and briefly as the 34th vice president in 1945 under Franklin D. Roosevelt. Assuming the presidency after Roosevelt's death, Truman implemented the Marshall Plan to rebuild the economy of Western Europe and established both the Truman Doctrine and NATO to contain the expansion of Soviet communism. He proposed numerous liberal domestic reforms, but few were enacted by the conservative coalition that dominated the Congress.","extract_html":"<p><b>Harry S. Truman</b> was the 33rd president of the United States, serving from 1945 to 1953. A member of the Democratic Party, he previously served as a United States senator from Missouri from 1935 to 1945 and briefly as the 34th vice president in 1945 under Franklin D. Roosevelt. Assuming the presidency after Roosevelt's death, Truman implemented the Marshall Plan to rebuild the economy of Western Europe and established both the Truman Doctrine and NATO to contain the expansion of Soviet communism. He proposed numerous liberal domestic reforms, but few were enacted by the conservative coalition that dominated the Congress.</p>","normalizedtitle":"Harry S. Truman"},{"type":"standard","title":"Thomas_E._Dewey","displaytitle":"<span class=\"mw-page-title-main\">Thomas E. Dewey</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q320061","titles":{"canonical":"Thomas_E._Dewey","normalized":"Thomas E. Dewey","display":"<span class=\"mw-page-title-main\">Thomas E. Dewey</span>"},"pageid":45596,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/5/52/Thomas_Dewey_in_1944.jpg/320px-Thomas_Dewey_in_1944.jpg","width":320,"height":426},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/5/52/Thomas_Dewey_in_1944.jpg","width":460,"height":612},"lang":"en","dir":"ltr","revision":"1183007631","tid":"de2a8f90-78e1-11ee-8274-49919497dbb1","timestamp":"2023-11-01T18:09:53Z","description":"American politician (1902–1971)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Thomas_E._Dewey","revisions":"https://en.wikipedia.org/wiki/Thomas_E._Dewey?action=history","edit":"https://en.wikipedia.org/wiki/Thomas_E._Dewey?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Thomas_E._Dewey"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Thomas_E._Dewey","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Thomas_E._Dewey","edit":"https://en.m.wikipedia.org/wiki/Thomas_E._Dewey?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Thomas_E._Dewey"}},"extract":"Thomas Edmund Dewey was an American lawyer and politician who served as the 47th governor of New York from 1943 to 1954. He was the Republican Party's nominee for president of the United States in 1944 and in 1948, where he lost in a major upset to Harry Truman. The 288 combined electoral votes Dewey received from both elections place him second behind William Jennings Bryan as the candidate with the most electoral votes who never acceded to the presidency.","extract_html":"<p><b>Thomas Edmund Dewey</b> was an American lawyer and politician who served as the 47th governor of New York from 1943 to 1954. He was the Republican Party's nominee for president of the United States in 1944 and in 1948, where he lost in a major upset to Harry Truman. The 288 combined electoral votes Dewey received from both elections place him second behind William Jennings Bryan as the candidate with the most electoral votes who never acceded to the presidency.</p>","normalizedtitle":"Thomas E. Dewey"},{"type":"standard","title":"1948_United_States_presidential_election","displaytitle":"<span class=\"mw-page-title-main\">1948 United States presidential election</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q568973","titles":{"canonical":"1948_United_States_presidential_election","normalized":"1948 United States presidential election","display":"<span class=\"mw-page-title-main\">1948 United States presidential election</span>"},"pageid":40562,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/ElectoralCollege1948.svg/320px-ElectoralCollege1948.svg.png","width":320,"height":186},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/ElectoralCollege1948.svg/1020px-ElectoralCollege1948.svg.png","width":1020,"height":593},"lang":"en","dir":"ltr","revision":"1183264447","tid":"461a17b0-7a0e-11ee-b475-5723eb077785","timestamp":"2023-11-03T06:00:16Z","description":"41st quadrennial U.S. presidential election","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/1948_United_States_presidential_election","revisions":"https://en.wikipedia.org/wiki/1948_United_States_presidential_election?action=history","edit":"https://en.wikipedia.org/wiki/1948_United_States_presidential_election?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:1948_United_States_presidential_election"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/1948_United_States_presidential_election","revisions":"https://en.m.wikipedia.org/wiki/Special:History/1948_United_States_presidential_election","edit":"https://en.m.wikipedia.org/wiki/1948_United_States_presidential_election?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:1948_United_States_presidential_election"}},"extract":"The 1948 United States presidential election was the 41st quadrennial presidential election. It was held on Tuesday, November 2, 1948. In one of the greatest election upsets in American history, incumbent President Harry S. Truman, the Democratic nominee, defeated heavily favored Republican Governor of New York Thomas E. Dewey, and third-party candidates, becoming the third president to succeed to the presidency upon his predecessor’s death and be elected to a full term.","extract_html":"<p>The <b>1948 United States presidential election</b> was the 41st quadrennial presidential election. It was held on Tuesday, November 2, 1948. In one of the greatest election upsets in American history, incumbent President Harry S. Truman, the Democratic nominee, defeated heavily favored Republican Governor of New York Thomas E. Dewey, and third-party candidates, becoming the third president to succeed to the presidency upon his predecessor’s death and be elected to a full term.</p>","normalizedtitle":"1948 United States presidential election"}],"year":1948},{"text":"The Holocaust: The largest massacre of Jews by German forces began at Majdanek concentration camp (execution trenches pictured).","pages":[{"type":"standard","title":"The_Holocaust","displaytitle":"<span class=\"mw-page-title-main\">The Holocaust</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2763","titles":{"canonical":"The_Holocaust","normalized":"The Holocaust","display":"<span class=\"mw-page-title-main\">The Holocaust</span>"},"pageid":10396793,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Selection_on_the_ramp_at_Auschwitz-Birkenau%2C_1944_%28Auschwitz_Album%29_1a.jpg/320px-Selection_on_the_ramp_at_Auschwitz-Birkenau%2C_1944_%28Auschwitz_Album%29_1a.jpg","width":320,"height":214},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Selection_on_the_ramp_at_Auschwitz-Birkenau%2C_1944_%28Auschwitz_Album%29_1a.jpg","width":4205,"height":2814},"lang":"en","dir":"ltr","revision":"1182686397","tid":"e2470150-79c0-11ee-b69b-db7251446f1e","timestamp":"2023-10-30T19:44:20Z","description":"Genocide of European Jews by Nazi Germany","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/The_Holocaust","revisions":"https://en.wikipedia.org/wiki/The_Holocaust?action=history","edit":"https://en.wikipedia.org/wiki/The_Holocaust?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:The_Holocaust"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/The_Holocaust","revisions":"https://en.m.wikipedia.org/wiki/Special:History/The_Holocaust","edit":"https://en.m.wikipedia.org/wiki/The_Holocaust?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:The_Holocaust"}},"extract":"The Holocaust was the genocide of European Jews during World War II. Between 1941 and 1945, Nazi Germany and its collaborators systematically murdered some six million Jews across German-occupied Europe, around two-thirds of Europe's Jewish population. The murders were carried out primarily through mass shootings and poison gas in extermination camps, chiefly Auschwitz-Birkenau, Treblinka, Belzec, Sobibor, and Chełmno in occupied Poland.","extract_html":"<p><b>The Holocaust</b> was the genocide of European Jews during World War II. Between 1941 and 1945, Nazi Germany and its collaborators systematically murdered some six million Jews across German-occupied Europe, around two-thirds of Europe's Jewish population. The murders were carried out primarily through mass shootings and poison gas in extermination camps, chiefly Auschwitz-Birkenau, Treblinka, Belzec, Sobibor, and Chełmno in occupied Poland.</p>","normalizedtitle":"The Holocaust"},{"type":"standard","title":"Operation_Harvest_Festival","displaytitle":"<span class=\"mw-page-title-main\">Operation Harvest Festival</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q153325","titles":{"canonical":"Operation_Harvest_Festival","normalized":"Operation Harvest Festival","display":"<span class=\"mw-page-title-main\">Operation Harvest Festival</span>"},"pageid":1012623,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b4/Alinas_PL_Maceba_miejsce_zamordowania_18400_zydow_na_MajdankuP5130085.jpg/320px-Alinas_PL_Maceba_miejsce_zamordowania_18400_zydow_na_MajdankuP5130085.jpg","width":320,"height":240},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Alinas_PL_Maceba_miejsce_zamordowania_18400_zydow_na_MajdankuP5130085.jpg","width":2400,"height":1800},"lang":"en","dir":"ltr","revision":"1181547522","tid":"fe3130e0-781f-11ee-a7ae-a763cb936970","timestamp":"2023-10-23T18:45:59Z","description":"1943 massacre of Jews during the Holocaust","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Operation_Harvest_Festival","revisions":"https://en.wikipedia.org/wiki/Operation_Harvest_Festival?action=history","edit":"https://en.wikipedia.org/wiki/Operation_Harvest_Festival?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Operation_Harvest_Festival"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Operation_Harvest_Festival","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Operation_Harvest_Festival","edit":"https://en.m.wikipedia.org/wiki/Operation_Harvest_Festival?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Operation_Harvest_Festival"}},"extract":"Operation Harvest Festival was the murder of up to 43,000 Jews at the Majdanek, Poniatowa and Trawniki concentration camps by the SS, the Order Police battalions, and the Ukrainian Sonderdienst on 3–4 November 1943.","extract_html":"<p><b>Operation Harvest Festival</b> was the murder of up to 43,000 Jews at the Majdanek, Poniatowa and Trawniki concentration camps by the SS, the Order Police battalions, and the Ukrainian <i>Sonderdienst</i> on 3–4 November 1943.</p>","normalizedtitle":"Operation Harvest Festival"},{"type":"standard","title":"Majdanek_concentration_camp","displaytitle":"<span class=\"mw-page-title-main\">Majdanek concentration camp</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q160135","titles":{"canonical":"Majdanek_concentration_camp","normalized":"Majdanek concentration camp","display":"<span class=\"mw-page-title-main\">Majdanek concentration camp</span>"},"pageid":253575,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/02/2013_KL_Majdanek_crematorium_-_01.jpg/320px-2013_KL_Majdanek_crematorium_-_01.jpg","width":320,"height":240},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/02/2013_KL_Majdanek_crematorium_-_01.jpg","width":4896,"height":3672},"lang":"en","dir":"ltr","revision":"1181538897","tid":"b1584a20-780f-11ee-bf60-fbb4e76ada2b","timestamp":"2023-10-23T17:42:00Z","description":"Nazi concentration camp","description_source":"local","coordinates":{"lat":51.22055556,"lon":22.59944444},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Majdanek_concentration_camp","revisions":"https://en.wikipedia.org/wiki/Majdanek_concentration_camp?action=history","edit":"https://en.wikipedia.org/wiki/Majdanek_concentration_camp?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Majdanek_concentration_camp"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Majdanek_concentration_camp","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Majdanek_concentration_camp","edit":"https://en.m.wikipedia.org/wiki/Majdanek_concentration_camp?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Majdanek_concentration_camp"}},"extract":"\n","extract_html":"<p>\n</p>","normalizedtitle":"Majdanek concentration camp"}],"year":1943},{"text":"World War II: U.S. Marines and U.S. Army forces began an attempt to encircle and destroy a regiment of Imperial Japanese Army troops on Guadalcanal.","pages":[{"type":"standard","title":"World_War_II","displaytitle":"<span class=\"mw-page-title-main\">World War II</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q362","titles":{"canonical":"World_War_II","normalized":"World War II","display":"<span class=\"mw-page-title-main\">World War II</span>"},"pageid":32927,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/10/Bundesarchiv_Bild_101I-646-5188-17%2C_Flugzeuge_Junkers_Ju_87.jpg/320px-Bundesarchiv_Bild_101I-646-5188-17%2C_Flugzeuge_Junkers_Ju_87.jpg","width":320,"height":218},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/1/10/Bundesarchiv_Bild_101I-646-5188-17%2C_Flugzeuge_Junkers_Ju_87.jpg","width":798,"height":544},"lang":"en","dir":"ltr","revision":"1182572419","tid":"e9a8c200-7789-11ee-8ad5-3b5acf1dbf95","timestamp":"2023-10-30T03:07:13Z","description":"1939–1945 global conflict","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/World_War_II","revisions":"https://en.wikipedia.org/wiki/World_War_II?action=history","edit":"https://en.wikipedia.org/wiki/World_War_II?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:World_War_II"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/World_War_II","revisions":"https://en.m.wikipedia.org/wiki/Special:History/World_War_II","edit":"https://en.m.wikipedia.org/wiki/World_War_II?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:World_War_II"}},"extract":"World War II or the Second World War was a global conflict that lasted from 1939 to 1945.\nThe vast majority of the world's countries, including all the great powers, fought as part of two opposing military alliances: the Allies and the Axis. Many participants threw their economic, industrial, and scientific capabilities behind this total war, blurring the distinction between civilian and military resources. Aircraft played a major role, enabling the strategic bombing of population centres and delivery of the only two nuclear weapons ever used in war. It was by far the deadliest conflict in history, resulting in 70 to 85 million fatalities, mostly civilians. Millions died due to genocides, including the Holocaust, as well as starvation, massacres, and disease. In the wake of Axis defeat, Germany, Austria and Japan were occupied, and war crimes tribunals were conducted against German and Japanese leaders.","extract_html":"<p><b>World War II</b> or the <b>Second World War</b> was a global conflict that lasted from 1939 to 1945.\nThe vast majority of the world's countries, including all the great powers, fought as part of two opposing military alliances: the Allies and the Axis. Many participants threw their economic, industrial, and scientific capabilities behind this total war, blurring the distinction between civilian and military resources. Aircraft played a major role, enabling the strategic bombing of population centres and delivery of the only two nuclear weapons ever used in war. It was by far the deadliest conflict in history, resulting in 70 to 85 million fatalities, mostly civilians. Millions died due to genocides, including the Holocaust, as well as starvation, massacres, and disease. In the wake of Axis defeat, Germany, Austria and Japan were occupied, and war crimes tribunals were conducted against German and Japanese leaders.</p>","normalizedtitle":"World War II"},{"type":"standard","title":"United_States_Marine_Corps","displaytitle":"<span class=\"mw-page-title-main\">United States Marine Corps</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q11218","titles":{"canonical":"United_States_Marine_Corps","normalized":"United States Marine Corps","display":"<span class=\"mw-page-title-main\">United States Marine Corps</span>"},"pageid":17349325,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9f/Emblem_of_the_United_States_Marine_Corps.svg/320px-Emblem_of_the_United_States_Marine_Corps.svg.png","width":320,"height":320},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9f/Emblem_of_the_United_States_Marine_Corps.svg/720px-Emblem_of_the_United_States_Marine_Corps.svg.png","width":720,"height":720},"lang":"en","dir":"ltr","revision":"1182916135","tid":"a7eca960-797a-11ee-a834-81202bd61f9f","timestamp":"2023-11-01T04:34:51Z","description":"Maritime land force service branch of the U.S. military","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/United_States_Marine_Corps","revisions":"https://en.wikipedia.org/wiki/United_States_Marine_Corps?action=history","edit":"https://en.wikipedia.org/wiki/United_States_Marine_Corps?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:United_States_Marine_Corps"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/United_States_Marine_Corps","revisions":"https://en.m.wikipedia.org/wiki/Special:History/United_States_Marine_Corps","edit":"https://en.m.wikipedia.org/wiki/United_States_Marine_Corps?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:United_States_Marine_Corps"}},"extract":"The United States Marine Corps (USMC), also referred to as the United States Marines, is the maritime land force service branch of the United States Armed Forces responsible for conducting expeditionary and amphibious operations through combined arms, implementing its own infantry, artillery, aerial, and special operations forces. The U.S. Marine Corps is one of the eight uniformed services of the United States.","extract_html":"<p>The <b>United States Marine Corps</b> (<b>USMC</b>), also referred to as the <b>United States Marines</b>, is the maritime land force service branch of the United States Armed Forces responsible for conducting expeditionary and amphibious operations through combined arms, implementing its own infantry, artillery, aerial, and special operations forces. The U.S. Marine Corps is one of the eight uniformed services of the United States.</p>","normalizedtitle":"United States Marine Corps"},{"type":"standard","title":"United_States_Army","displaytitle":"<span class=\"mw-page-title-main\">United States Army</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q9212","titles":{"canonical":"United_States_Army","normalized":"United States Army","display":"<span class=\"mw-page-title-main\">United States Army</span>"},"pageid":32087,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/Mark_of_the_United_States_Army.svg/320px-Mark_of_the_United_States_Army.svg.png","width":320,"height":320},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/Mark_of_the_United_States_Army.svg/921px-Mark_of_the_United_States_Army.svg.png","width":921,"height":921},"lang":"en","dir":"ltr","revision":"1182987186","tid":"a74a9d00-797a-11ee-b7fe-2f1c42385a90","timestamp":"2023-11-01T15:44:20Z","description":"Land service branch of the U.S. military","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/United_States_Army","revisions":"https://en.wikipedia.org/wiki/United_States_Army?action=history","edit":"https://en.wikipedia.org/wiki/United_States_Army?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:United_States_Army"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/United_States_Army","revisions":"https://en.m.wikipedia.org/wiki/Special:History/United_States_Army","edit":"https://en.m.wikipedia.org/wiki/United_States_Army?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:United_States_Army"}},"extract":"The United States Army (USA) is the land service branch of the United States Armed Forces. It is one of the eight U.S. uniformed services, and is designated as the Army of the United States in the U.S. Constitution. The oldest and most senior branch of the U.S. military in order of precedence, the modern U.S. Army has its roots in the Continental Army, which was formed on 14 June 1775 to fight the American Revolutionary War (1775–1783)—against the British for independence before the United States was established as a country. After the Revolutionary War, the Congress of the Confederation created the United States Army on 3 June 1784 to replace the disbanded Continental Army. The United States Army considers itself a continuation of the Continental Army, and thus considers its institutional inception to be the origin of that armed force in 1775.","extract_html":"<p>The <b>United States Army</b> (<b>USA</b>) is the land service branch of the United States Armed Forces. It is one of the eight U.S. uniformed services, and is designated as the Army of the United States in the U.S. Constitution. The oldest and most senior branch of the U.S. military in order of precedence, the modern U.S. Army has its roots in the Continental Army, which was formed on 14 June 1775 to fight the American Revolutionary War (1775–1783)—against the British for independence before the United States was established as a country. After the Revolutionary War, the Congress of the Confederation created the United States Army on 3 June 1784 to replace the disbanded Continental Army. The United States Army considers itself a continuation of the Continental Army, and thus considers its institutional inception to be the origin of that armed force in 1775.</p>","normalizedtitle":"United States Army"},{"type":"standard","title":"Koli_Point_action","displaytitle":"<span class=\"mw-page-title-main\">Koli Point action</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2394303","titles":{"canonical":"Koli_Point_action","normalized":"Koli Point action","display":"<span class=\"mw-page-title-main\">Koli Point action</span>"},"pageid":13931112,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/8/85/GuadKoliPoint75mm.jpg/320px-GuadKoliPoint75mm.jpg","width":320,"height":134},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/8/85/GuadKoliPoint75mm.jpg","width":2277,"height":951},"lang":"en","dir":"ltr","revision":"1183271868","tid":"eb155940-7a19-11ee-a213-93bb4cf86340","timestamp":"2023-11-03T07:23:40Z","description":"1942 Allied victory over Japan on Guadalcanal","description_source":"local","coordinates":{"lat":-9.45,"lon":160.17},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Koli_Point_action","revisions":"https://en.wikipedia.org/wiki/Koli_Point_action?action=history","edit":"https://en.wikipedia.org/wiki/Koli_Point_action?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Koli_Point_action"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Koli_Point_action","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Koli_Point_action","edit":"https://en.m.wikipedia.org/wiki/Koli_Point_action?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Koli_Point_action"}},"extract":"The Koli Point action, during 3–12 November 1942, was an engagement between U.S. Marine Corps and U.S. Army forces and Imperial Japanese Army forces around Koli Point on Guadalcanal during the Guadalcanal campaign. The U.S. forces were under the overall command of Major General Alexander Vandegrift, while the Japanese forces were under the overall command of Lieutenant General Harukichi Hyakutake.","extract_html":"<p>The <b>Koli Point action</b>, during 3–12 November 1942, was an engagement between U.S. Marine Corps and U.S. Army forces and Imperial Japanese Army forces around Koli Point on Guadalcanal during the Guadalcanal campaign. The U.S. forces were under the overall command of Major General Alexander Vandegrift, while the Japanese forces were under the overall command of Lieutenant General Harukichi Hyakutake.</p>","normalizedtitle":"Koli Point action"},{"type":"standard","title":"Imperial_Japanese_Army","displaytitle":"<span class=\"mw-page-title-main\">Imperial Japanese Army</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q276535","titles":{"canonical":"Imperial_Japanese_Army","normalized":"Imperial Japanese Army","display":"<span class=\"mw-page-title-main\">Imperial Japanese Army</span>"},"pageid":481708,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/War_flag_of_the_Imperial_Japanese_Army_%281868%E2%80%931945%29.svg/320px-War_flag_of_the_Imperial_Japanese_Army_%281868%E2%80%931945%29.svg.png","width":320,"height":213},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/War_flag_of_the_Imperial_Japanese_Army_%281868%E2%80%931945%29.svg/900px-War_flag_of_the_Imperial_Japanese_Army_%281868%E2%80%931945%29.svg.png","width":900,"height":600},"lang":"en","dir":"ltr","revision":"1183292163","tid":"650c25c0-7a3e-11ee-a59f-4348e89b22ce","timestamp":"2023-11-03T11:44:45Z","description":"Ground force of the Empire of Japan","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Imperial_Japanese_Army","revisions":"https://en.wikipedia.org/wiki/Imperial_Japanese_Army?action=history","edit":"https://en.wikipedia.org/wiki/Imperial_Japanese_Army?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Imperial_Japanese_Army"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Imperial_Japanese_Army","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Imperial_Japanese_Army","edit":"https://en.m.wikipedia.org/wiki/Imperial_Japanese_Army?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Imperial_Japanese_Army"}},"extract":"The Imperial Japanese Army  (IJA) was the principal ground force of the Empire of Japan. Forming one of the military branches of the Imperial Japanese Armed Forces (IJAF), it was controlled by the Imperial Japanese Army General Staff Office and the Army Ministry, both of which were nominally subordinate to the Emperor of Japan, the supreme commander of IJAF. During the 20th century, an Inspectorate General of Aviation became the third agency with oversight of the IJA. At its height, the IJA was one of the most influential factions in the politics of Japan and was one of the most powerful armies in the world. The IJA was also notorious for committing numerous war crimes during the Second Sino-Japanese War and the Pacific War, such as the Nanjing Massacre and the Bataan Death March.","extract_html":"<p>The <b>Imperial Japanese Army</b><span style=\"font-weight:normal\"> </span> (IJA) was the principal ground force of the Empire of Japan. Forming one of the military branches of the Imperial Japanese Armed Forces (IJAF), it was controlled by the Imperial Japanese Army General Staff Office and the Army Ministry, both of which were nominally subordinate to the Emperor of Japan, the supreme commander of IJAF. During the 20th century, an Inspectorate General of Aviation became the third agency with oversight of the IJA. At its height, the IJA was one of the most influential factions in the politics of Japan and was one of the most powerful armies in the world. The IJA was also notorious for committing numerous war crimes during the Second Sino-Japanese War and the Pacific War, such as the Nanjing Massacre and the Bataan Death March.</p>","normalizedtitle":"Imperial Japanese Army"},{"type":"standard","title":"Guadalcanal","displaytitle":"<span class=\"mw-page-title-main\">Guadalcanal</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q192767","titles":{"canonical":"Guadalcanal","normalized":"Guadalcanal","display":"<span class=\"mw-page-title-main\">Guadalcanal</span>"},"pageid":113645,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/f/fb/GuadalcanalCloseup.png/320px-GuadalcanalCloseup.png","width":320,"height":229},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/f/fb/GuadalcanalCloseup.png","width":550,"height":394},"lang":"en","dir":"ltr","revision":"1183279610","tid":"f7e710a0-7a28-11ee-bae9-81c8c20ff677","timestamp":"2023-11-03T09:11:24Z","description":"Principal island of Solomon Islands","description_source":"local","coordinates":{"lat":-9.59,"lon":160.235},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Guadalcanal","revisions":"https://en.wikipedia.org/wiki/Guadalcanal?action=history","edit":"https://en.wikipedia.org/wiki/Guadalcanal?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Guadalcanal"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Guadalcanal","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Guadalcanal","edit":"https://en.m.wikipedia.org/wiki/Guadalcanal?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Guadalcanal"}},"extract":"Guadalcanal is the principal island in Guadalcanal Province of the Solomon Islands, located in the southwestern Pacific Ocean, northeast of Australia. It is the largest island in the Solomons by area and the second-largest by population. The island is mainly covered in dense tropical rainforest and has a mountainous hinterland.","extract_html":"<p><b>Guadalcanal</b> is the principal island in Guadalcanal Province of the Solomon Islands, located in the southwestern Pacific Ocean, northeast of Australia. It is the largest island in the Solomons by area and the second-largest by population. The island is mainly covered in dense tropical rainforest and has a mountainous hinterland.</p>","normalizedtitle":"Guadalcanal"}],"year":1942},{"text":"Almost 98 percent of reported votes in a Greek referendum supported the restoration of George II as King of the Hellenes.","pages":[{"type":"standard","title":"1935_Greek_monarchy_referendum","displaytitle":"<span class=\"mw-page-title-main\">1935 Greek monarchy referendum</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q3454881","titles":{"canonical":"1935_Greek_monarchy_referendum","normalized":"1935 Greek monarchy referendum","display":"<span class=\"mw-page-title-main\">1935 Greek monarchy referendum</span>"},"pageid":4150356,"lang":"en","dir":"ltr","revision":"1136866727","tid":"bf05f9d0-67dc-11ee-9264-77505a975220","timestamp":"2023-02-01T15:31:46Z","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/1935_Greek_monarchy_referendum","revisions":"https://en.wikipedia.org/wiki/1935_Greek_monarchy_referendum?action=history","edit":"https://en.wikipedia.org/wiki/1935_Greek_monarchy_referendum?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:1935_Greek_monarchy_referendum"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/1935_Greek_monarchy_referendum","revisions":"https://en.m.wikipedia.org/wiki/Special:History/1935_Greek_monarchy_referendum","edit":"https://en.m.wikipedia.org/wiki/1935_Greek_monarchy_referendum?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:1935_Greek_monarchy_referendum"}},"extract":"A referendum on restoring the monarchy was held in Greece on 3 November 1935. The proposal was approved by nearly 97.9% of voters, although the conduct during the referendum is not considered to have been free or fair. George II returned from exile and was restored to the throne on 25 November 1935.","extract_html":"<p>A referendum on restoring the monarchy was held in Greece on 3 November 1935. The proposal was approved by nearly 97.9% of voters, although the conduct during the referendum is not considered to have been free or fair. George II returned from exile and was restored to the throne on 25 November 1935.</p>","normalizedtitle":"1935 Greek monarchy referendum"},{"type":"standard","title":"George_II_of_Greece","displaytitle":"<span class=\"mw-page-title-main\">George II of Greece</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q152935","titles":{"canonical":"George_II_of_Greece","normalized":"George II of Greece","display":"<span class=\"mw-page-title-main\">George II of Greece</span>"},"pageid":160203,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/5/58/Georgeiiofgreece.jpg/320px-Georgeiiofgreece.jpg","width":320,"height":441},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/5/58/Georgeiiofgreece.jpg","width":1593,"height":2197},"lang":"en","dir":"ltr","revision":"1178633227","tid":"930b5650-778a-11ee-865c-e5af8cde6d32","timestamp":"2023-10-04T22:18:55Z","description":"King of Greece from 1922 to 1924 and 1935 to 1947)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/George_II_of_Greece","revisions":"https://en.wikipedia.org/wiki/George_II_of_Greece?action=history","edit":"https://en.wikipedia.org/wiki/George_II_of_Greece?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:George_II_of_Greece"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/George_II_of_Greece","revisions":"https://en.m.wikipedia.org/wiki/Special:History/George_II_of_Greece","edit":"https://en.m.wikipedia.org/wiki/George_II_of_Greece?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:George_II_of_Greece"}},"extract":"George II was King of Greece from 27 September 1922 until 25 March 1924 and from 25 November 1935 until his death in 1947.","extract_html":"<p><b>George II</b> was King of Greece from 27 September 1922 until 25 March 1924 and from 25 November 1935 until his death in 1947.</p>","normalizedtitle":"George II of Greece"},{"type":"standard","title":"List_of_kings_of_Greece","displaytitle":"<span class=\"mw-page-title-main\">List of kings of Greece</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2198995","titles":{"canonical":"List_of_kings_of_Greece","normalized":"List of kings of Greece","display":"<span class=\"mw-page-title-main\">List of kings of Greece</span>"},"pageid":40941755,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Royal_Coat_of_Arms_of_Greece.svg/320px-Royal_Coat_of_Arms_of_Greece.svg.png","width":320,"height":376},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Royal_Coat_of_Arms_of_Greece.svg/512px-Royal_Coat_of_Arms_of_Greece.svg.png","width":512,"height":602},"lang":"en","dir":"ltr","revision":"1159370750","tid":"a08339a0-67ff-11ee-bf52-f9c3765f1fe0","timestamp":"2023-06-09T22:07:28Z","description":"List of rulers of the Kingdom of Greece","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/List_of_kings_of_Greece","revisions":"https://en.wikipedia.org/wiki/List_of_kings_of_Greece?action=history","edit":"https://en.wikipedia.org/wiki/List_of_kings_of_Greece?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:List_of_kings_of_Greece"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/List_of_kings_of_Greece","revisions":"https://en.m.wikipedia.org/wiki/Special:History/List_of_kings_of_Greece","edit":"https://en.m.wikipedia.org/wiki/List_of_kings_of_Greece?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:List_of_kings_of_Greece"}},"extract":"The Kingdom of Greece was ruled by the House of Wittelsbach from 1832 to 1862 and by the House of Glücksburg from 1863 to 1924 and, after being temporarily abolished in favor of the Second Hellenic Republic, again from 1935 to 1973, when it was once more abolished and replaced by the Third Hellenic Republic.","extract_html":"<p>The Kingdom of Greece was ruled by the House of Wittelsbach from 1832 to 1862 and by the House of Glücksburg from 1863 to 1924 and, after being temporarily abolished in favor of the Second Hellenic Republic, again from 1935 to 1973, when it was once more abolished and replaced by the Third Hellenic Republic.</p>","normalizedtitle":"List of kings of Greece"}],"year":1935},{"text":"The Fashoda Incident ended with French forces withdrawing after several months of military stalemate with the British in Fashoda (now in South Sudan).","pages":[{"type":"standard","title":"Fashoda_Incident","displaytitle":"<span class=\"mw-page-title-main\">Fashoda Incident</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q722699","titles":{"canonical":"Fashoda_Incident","normalized":"Fashoda Incident","display":"<span class=\"mw-page-title-main\">Fashoda Incident</span>"},"pageid":283542,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Fashoda_Incident_map_-_en.svg/320px-Fashoda_Incident_map_-_en.svg.png","width":320,"height":259},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Fashoda_Incident_map_-_en.svg/3384px-Fashoda_Incident_map_-_en.svg.png","width":3384,"height":2740},"lang":"en","dir":"ltr","revision":"1183285787","tid":"6088cc10-7a34-11ee-97cf-6f1e1569e40e","timestamp":"2023-11-03T10:33:05Z","description":"1898 Anglo-French dispute in East Africa","description_source":"local","coordinates":{"lat":9.8875,"lon":32.11027778},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Fashoda_Incident","revisions":"https://en.wikipedia.org/wiki/Fashoda_Incident?action=history","edit":"https://en.wikipedia.org/wiki/Fashoda_Incident?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Fashoda_Incident"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Fashoda_Incident","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Fashoda_Incident","edit":"https://en.m.wikipedia.org/wiki/Fashoda_Incident?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Fashoda_Incident"}},"extract":"The Fashoda Incident, also known as the Fashoda Crisis, was an international incident and the climax of imperialist territorial disputes between Britain and France in East Africa, occurring in 1898. A French expedition to Fashoda on the White Nile sought to gain control of the Upper Nile river basin and thereby exclude Britain from Sudan. The French party and a British-Egyptian force met on friendly terms, but back in Europe it became a war scare. The British held firm as both empires stood on the verge of war with heated rhetoric on both sides. Under heavy pressure, the French withdrew, ensuring Anglo-Egyptian control over the area.","extract_html":"<p>The <b>Fashoda Incident</b>, also known as the <b>Fashoda Crisis</b>, was an international incident and the climax of imperialist territorial disputes between Britain and France in East Africa, occurring in 1898. A French expedition to Fashoda on the White Nile sought to gain control of the Upper Nile river basin and thereby exclude Britain from Sudan. The French party and a British-Egyptian force met on friendly terms, but back in Europe it became a war scare. The British held firm as both empires stood on the verge of war with heated rhetoric on both sides. Under heavy pressure, the French withdrew, ensuring Anglo-Egyptian control over the area.</p>","normalizedtitle":"Fashoda Incident"},{"type":"standard","title":"Kodok","displaytitle":"<span class=\"mw-page-title-main\">Kodok</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q1888763","titles":{"canonical":"Kodok","normalized":"Kodok","display":"<span class=\"mw-page-title-main\">Kodok</span>"},"pageid":1515533,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Fashoda_-_The_Governor%27s_House_%281906%29_-_TIMEA.jpg/320px-Fashoda_-_The_Governor%27s_House_%281906%29_-_TIMEA.jpg","width":320,"height":151},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/9/95/Fashoda_-_The_Governor%27s_House_%281906%29_-_TIMEA.jpg","width":993,"height":468},"lang":"en","dir":"ltr","revision":"1183269215","tid":"d50afb80-7a16-11ee-88a8-216763b7aa0a","timestamp":"2023-11-03T07:01:35Z","description":"Place in Upper Nile State, South Sudan","description_source":"local","coordinates":{"lat":9.8875,"lon":32.11027778},"content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Kodok","revisions":"https://en.wikipedia.org/wiki/Kodok?action=history","edit":"https://en.wikipedia.org/wiki/Kodok?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Kodok"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Kodok","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Kodok","edit":"https://en.m.wikipedia.org/wiki/Kodok?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Kodok"}},"extract":"Kodok or Kothok, formerly known as Fashoda, is a town in the north-eastern South Sudanese state of Upper Nile. Kodok is the capital of Shilluk country, formally known as the Shilluk Kingdom. Shilluk had been an independent kingdom for more than sixteen centuries. Fashoda is best known as the place where the British and French nearly went to war in 1898 in the Fashoda Incident.","extract_html":"<p><b>Kodok</b> or <b>Kothok</b>, formerly known as <b>Fashoda</b>, is a town in the north-eastern South Sudanese state of Upper Nile. Kodok is the capital of Shilluk country, formally known as the Shilluk Kingdom. Shilluk had been an independent kingdom for more than sixteen centuries. Fashoda is best known as the place where the British and French nearly went to war in 1898 in the Fashoda Incident.</p>","normalizedtitle":"Kodok"}],"year":1898},{"text":"Indigenous Mapuche began an uprising against the occupation of Araucanía by Chile.","pages":[{"type":"standard","title":"Mapuche","displaytitle":"<span class=\"mw-page-title-main\">Mapuche</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q178484","titles":{"canonical":"Mapuche","normalized":"Mapuche","display":"<span class=\"mw-page-title-main\">Mapuche</span>"},"pageid":392305,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Mujeres_mapuches_en_la_entrega_terreno_a_Comunidad_Mapuche_Lorenzo_Quintrileo_de_Tir%C3%BAa.jpg/320px-Mujeres_mapuches_en_la_entrega_terreno_a_Comunidad_Mapuche_Lorenzo_Quintrileo_de_Tir%C3%BAa.jpg","width":320,"height":213},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/4/46/Mujeres_mapuches_en_la_entrega_terreno_a_Comunidad_Mapuche_Lorenzo_Quintrileo_de_Tir%C3%BAa.jpg","width":5184,"height":3456},"lang":"en","dir":"ltr","revision":"1182407326","tid":"063eb360-7614-11ee-87c0-e3a5ebc06e58","timestamp":"2023-10-29T04:31:23Z","description":"Ethnic group in South America","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Mapuche","revisions":"https://en.wikipedia.org/wiki/Mapuche?action=history","edit":"https://en.wikipedia.org/wiki/Mapuche?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Mapuche"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Mapuche","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Mapuche","edit":"https://en.m.wikipedia.org/wiki/Mapuche?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Mapuche"}},"extract":"The Mapuche is a group of native indigenous inhabitants of south-central Chile and southwestern Argentina, including parts of Patagonia. The collective term refers to a wide-ranging ethnicity composed of various groups who share a common social, religious, and economic structure, as well as a common linguistic heritage as Mapudungun speakers. Their homelands once extended from Aconcagua Valley to the Chiloé Archipelago and later spread eastward to Puelmapu, a land comprising part of the Argentine pampa and Patagonia. Today the collective group makes up over 80% of the indigenous peoples in Chile and about 9% of the total Chilean population. The Mapuche are concentrated in the Araucanía region. Many have migrated from rural areas to the cities of Santiago and Buenos Aires for economic opportunities.","extract_html":"<p>The <b>Mapuche</b> is a group of native indigenous inhabitants of south-central Chile and southwestern Argentina, including parts of Patagonia. The collective term refers to a wide-ranging ethnicity composed of various groups who share a common social, religious, and economic structure, as well as a common linguistic heritage as Mapudungun speakers. Their homelands once extended from Aconcagua Valley to the Chiloé Archipelago and later spread eastward to Puelmapu, a land comprising part of the Argentine pampa and Patagonia. Today the collective group makes up over 80% of the indigenous peoples in Chile and about 9% of the total Chilean population. The Mapuche are concentrated in the Araucanía region. Many have migrated from rural areas to the cities of Santiago and Buenos Aires for economic opportunities.</p>","normalizedtitle":"Mapuche"},{"type":"standard","title":"Mapuche_uprising_of_1881","displaytitle":"<span class=\"mw-page-title-main\">Mapuche uprising of 1881</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q16824925","titles":{"canonical":"Mapuche_uprising_of_1881","normalized":"Mapuche uprising of 1881","display":"<span class=\"mw-page-title-main\">Mapuche uprising of 1881</span>"},"pageid":41575537,"lang":"en","dir":"ltr","revision":"1124834626","tid":"2d8873b0-6800-11ee-986d-91c16720e09e","timestamp":"2022-11-30T19:20:14Z","description":"1881 native uprising against the Chilean occupation of Araucanía","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Mapuche_uprising_of_1881","revisions":"https://en.wikipedia.org/wiki/Mapuche_uprising_of_1881?action=history","edit":"https://en.wikipedia.org/wiki/Mapuche_uprising_of_1881?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Mapuche_uprising_of_1881"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Mapuche_uprising_of_1881","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Mapuche_uprising_of_1881","edit":"https://en.m.wikipedia.org/wiki/Mapuche_uprising_of_1881?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Mapuche_uprising_of_1881"}},"extract":"The last major rebellion of the indigenous Mapuches of Araucanía took place in 1881, during the last phase of the Occupation of Araucanía (1861–1883) by the Chilean state. It was planned by Mapuche chiefs in March 1881 to be launched in November the same year. Mapuche support for the uprising was not unanimous: Some Mapuche factions sided with the Chileans and others declared themselves neutral. The organizers of the uprising did however succeed in involving Mapuche factions that had not previously been at war with Chile. With most of the attacks repelled within a matters of days Chile went on the next years to consolidate its conquests.","extract_html":"<p>The last major rebellion of the indigenous Mapuches of Araucanía took place in 1881, during the last phase of the Occupation of Araucanía (1861–1883) by the Chilean state. It was planned by Mapuche chiefs in March 1881 to be launched in November the same year. Mapuche support for the uprising was not unanimous: Some Mapuche factions sided with the Chileans and others declared themselves neutral. The organizers of the uprising did however succeed in involving Mapuche factions that had not previously been at war with Chile. With most of the attacks repelled within a matters of days Chile went on the next years to consolidate its conquests.</p>","normalizedtitle":"Mapuche uprising of 1881"},{"type":"standard","title":"Occupation_of_Araucanía","displaytitle":"<span class=\"mw-page-title-main\">Occupation of Araucanía</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2422135","titles":{"canonical":"Occupation_of_Araucanía","normalized":"Occupation of Araucanía","display":"<span class=\"mw-page-title-main\">Occupation of Araucanía</span>"},"pageid":8887430,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/d/dd/Fuerte_de_Pur%C3%A9n_Chile.jpg/320px-Fuerte_de_Pur%C3%A9n_Chile.jpg","width":320,"height":240},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Fuerte_de_Pur%C3%A9n_Chile.jpg","width":1280,"height":960},"lang":"en","dir":"ltr","revision":"1174100828","tid":"f91c90a0-67e3-11ee-adbf-837b5dfb5396","timestamp":"2023-09-06T09:39:43Z","description":"Series of incursions by the Chilean army and settlers into Mapuche territory (1861-83)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Occupation_of_Araucan%C3%ADa","revisions":"https://en.wikipedia.org/wiki/Occupation_of_Araucan%C3%ADa?action=history","edit":"https://en.wikipedia.org/wiki/Occupation_of_Araucan%C3%ADa?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Occupation_of_Araucan%C3%ADa"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Occupation_of_Araucan%C3%ADa","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Occupation_of_Araucan%C3%ADa","edit":"https://en.m.wikipedia.org/wiki/Occupation_of_Araucan%C3%ADa?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Occupation_of_Araucan%C3%ADa"}},"extract":"The Occupation of Araucanía or Pacification of Araucanía (1861–1883) was a series of military campaigns, agreements and penetrations by the Chilean army and settlers into Mapuche territory which led to the incorporation of Araucanía into Chilean national territory. Pacification of Araucanía was the expression used by the Chilean authorities for this process. The conflict was concurrent with Argentine campaigns against the Mapuche (1878–1885) and Chile's wars with Spain (1865–1866) and with Peru and Bolivia (1879–1883).","extract_html":"<p>The <b>Occupation of Araucanía</b> or <b>Pacification of Araucanía</b> (1861–1883) was a series of military campaigns, agreements and penetrations by the Chilean army and settlers into Mapuche territory which led to the incorporation of Araucanía into Chilean national territory. <i>Pacification of Araucanía</i> was the expression used by the Chilean authorities for this process. The conflict was concurrent with Argentine campaigns against the Mapuche (1878–1885) and Chile's wars with Spain (1865–1866) and with Peru and Bolivia (1879–1883).</p>","normalizedtitle":"Occupation of Araucanía"},{"type":"standard","title":"Araucanía_(historic_region)","displaytitle":"<span class=\"mw-page-title-main\">Araucanía (historic region)</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q3492932","titles":{"canonical":"Araucanía_(historic_region)","normalized":"Araucanía (historic region)","display":"<span class=\"mw-page-title-main\">Araucanía (historic region)</span>"},"pageid":1046545,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/7/75/Change_of_Chile_frontier_border_in_the_Occupation_of_the_Araucan%C3%ADa_-_1870.jpg/320px-Change_of_Chile_frontier_border_in_the_Occupation_of_the_Araucan%C3%ADa_-_1870.jpg","width":320,"height":402},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/7/75/Change_of_Chile_frontier_border_in_the_Occupation_of_the_Araucan%C3%ADa_-_1870.jpg","width":577,"height":725},"lang":"en","dir":"ltr","revision":"1181806947","tid":"e22f8e30-731c-11ee-9e29-b9eb15ac887b","timestamp":"2023-10-25T09:57:17Z","description":"Historic indigenously-inhabited region of Chile","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Araucan%C3%ADa_(historic_region)","revisions":"https://en.wikipedia.org/wiki/Araucan%C3%ADa_(historic_region)?action=history","edit":"https://en.wikipedia.org/wiki/Araucan%C3%ADa_(historic_region)?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Araucan%C3%ADa_(historic_region)"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Araucan%C3%ADa_(historic_region)","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Araucan%C3%ADa_(historic_region)","edit":"https://en.m.wikipedia.org/wiki/Araucan%C3%ADa_(historic_region)?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Araucan%C3%ADa_(historic_region)"}},"extract":"Araucanía or Araucana was the Spanish name given to the region of Chile inhabited by the Mapuche peoples known as the Moluche in the 18th century. Prior to the Spanish conquest of Chile, the lands of the Moluche lay between the Itata River and Toltén River.","extract_html":"<p><b>Araucanía</b> or <b>Araucana</b> was the Spanish name given to the region of Chile inhabited by the Mapuche peoples known as the Moluche in the 18th century. Prior to the Spanish conquest of Chile, the lands of the Moluche lay between the Itata River and Toltén River.</p>","normalizedtitle":"Araucanía (historic region)"}],"year":1881},{"text":"The current melody of Kimigayo, the national anthem of Japan, was adopted.","pages":[{"type":"standard","title":"Kimigayo","displaytitle":"<span class=\"mw-page-title-main\">Kimigayo</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q81534","titles":{"canonical":"Kimigayo","normalized":"Kimigayo","display":"<span class=\"mw-page-title-main\">Kimigayo</span>"},"pageid":147709,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Kimigayo.score.svg/320px-Kimigayo.score.svg.png","width":320,"height":225},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Kimigayo.score.svg/525px-Kimigayo.score.svg.png","width":525,"height":369},"lang":"en","dir":"ltr","revision":"1176986711","tid":"fee77260-7199-11ee-b09e-a3d42a4bbd9d","timestamp":"2023-09-25T06:35:10Z","description":"National anthem of Japan","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Kimigayo","revisions":"https://en.wikipedia.org/wiki/Kimigayo?action=history","edit":"https://en.wikipedia.org/wiki/Kimigayo?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Kimigayo"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Kimigayo","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Kimigayo","edit":"https://en.m.wikipedia.org/wiki/Kimigayo?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Kimigayo"}},"extract":"\"Kimigayo\"  is the national anthem of Japan. The lyrics are from a waka poem written by an unnamed author in the Heian period (794–1185), and the current melody was chosen in 1880, replacing an unpopular melody composed by John William Fenton eleven years earlier. While the title \"Kimigayo\" is usually translated as \"His Imperial Majesty's Reign\", no official translation of the title or lyrics has been established in law.","extract_html":"<p>\"<b>Kimigayo</b>\"<span style=\"font-weight:normal\"> </span> is the national anthem of Japan. The lyrics are from a <i><span><i lang=\"ja-Latn\">waka</i></span></i> poem written by an unnamed author in the Heian period (794–1185), and the current melody was chosen in 1880, replacing an unpopular melody composed by John William Fenton eleven years earlier. While the title \"Kimigayo\" is usually translated as \"His Imperial Majesty's Reign\", no official translation of the title or lyrics has been established in law.</p>","normalizedtitle":"Kimigayo"},{"type":"standard","title":"National_anthem","displaytitle":"<span class=\"mw-page-title-main\">National anthem</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q23691","titles":{"canonical":"National_anthem","normalized":"National anthem","display":"<span class=\"mw-page-title-main\">National anthem</span>"},"pageid":234540,"lang":"en","dir":"ltr","revision":"1182659653","tid":"11ac7b00-7741-11ee-9501-5d0bffda7bbd","timestamp":"2023-10-30T16:26:21Z","description":"Song that represents a country or sovereign state","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/National_anthem","revisions":"https://en.wikipedia.org/wiki/National_anthem?action=history","edit":"https://en.wikipedia.org/wiki/National_anthem?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:National_anthem"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/National_anthem","revisions":"https://en.m.wikipedia.org/wiki/Special:History/National_anthem","edit":"https://en.m.wikipedia.org/wiki/National_anthem?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:National_anthem"}},"extract":"A national anthem is a patriotic musical composition symbolizing and evoking eulogies of the history and traditions of a country or nation. The majority of national anthems are marches or hymns in style. American, Central Asian, and European nations tend towards more ornate and operatic pieces, while those in the Middle East, Oceania, Africa, and the Caribbean use a more simplistic fanfare. Some countries that are devolved into multiple constituent states have their own official musical compositions for them ; their constituencies' songs are sometimes referred to as national anthems even though they are not sovereign states.","extract_html":"<p>A <b>national anthem</b> is a patriotic musical composition symbolizing and evoking eulogies of the history and traditions of a country or nation. The majority of national anthems are marches or hymns in style. American, Central Asian, and European nations tend towards more ornate and operatic pieces, while those in the Middle East, Oceania, Africa, and the Caribbean use a more simplistic fanfare. Some countries that are devolved into multiple constituent states have their own official musical compositions for them ; their constituencies' songs are sometimes referred to as national anthems even though they are not sovereign states.</p>","normalizedtitle":"National anthem"}],"year":1880},{"text":"A new constitution drafted by Johan Rudolph Thorbecke was proclaimed, limiting the powers of the Dutch monarchy.","pages":[{"type":"standard","title":"Constitution_of_the_Netherlands","displaytitle":"<span class=\"mw-page-title-main\">Constitution of the Netherlands</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2299064","titles":{"canonical":"Constitution_of_the_Netherlands","normalized":"Constitution of the Netherlands","display":"<span class=\"mw-page-title-main\">Constitution of the Netherlands</span>"},"pageid":70124,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/8/8f/State_coat_of_arms_of_the_Netherlands.svg/320px-State_coat_of_arms_of_the_Netherlands.svg.png","width":320,"height":252},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/8/8f/State_coat_of_arms_of_the_Netherlands.svg/756px-State_coat_of_arms_of_the_Netherlands.svg.png","width":756,"height":595},"lang":"en","dir":"ltr","revision":"1173394224","tid":"273c8be0-7363-11ee-a46e-6d60780108da","timestamp":"2023-09-02T04:12:44Z","description":"Basic law of the Netherlands","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Constitution_of_the_Netherlands","revisions":"https://en.wikipedia.org/wiki/Constitution_of_the_Netherlands?action=history","edit":"https://en.wikipedia.org/wiki/Constitution_of_the_Netherlands?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Constitution_of_the_Netherlands"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Constitution_of_the_Netherlands","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Constitution_of_the_Netherlands","edit":"https://en.m.wikipedia.org/wiki/Constitution_of_the_Netherlands?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Constitution_of_the_Netherlands"}},"extract":"The Constitution for the Kingdom of the Netherlands is one of two fundamental documents governing the Kingdom of the Netherlands as well as the fundamental law of the European territory of the Kingdom of the Netherlands. It is generally seen as directly derived from the one issued in 1815, constituting a constitutional monarchy; it is the third oldest constitution still in use worldwide.","extract_html":"<p>The <b>Constitution for the Kingdom of the Netherlands</b> is one of two fundamental documents governing the Kingdom of the Netherlands as well as the fundamental law of the European territory of the Kingdom of the Netherlands. It is generally seen as directly derived from the one issued in 1815, constituting a constitutional monarchy; it is the third oldest constitution still in use worldwide.</p>","normalizedtitle":"Constitution of the Netherlands"},{"type":"standard","title":"Johan_Rudolph_Thorbecke","displaytitle":"<span class=\"mw-page-title-main\">Johan Rudolph Thorbecke</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q182509","titles":{"canonical":"Johan_Rudolph_Thorbecke","normalized":"Johan Rudolph Thorbecke","display":"<span class=\"mw-page-title-main\">Johan Rudolph Thorbecke</span>"},"pageid":23690058,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/7/7a/Johan_Heinrich_Neuman_-_Johan_Rudolf_Thorbecke.jpg/320px-Johan_Heinrich_Neuman_-_Johan_Rudolf_Thorbecke.jpg","width":320,"height":386},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Johan_Heinrich_Neuman_-_Johan_Rudolf_Thorbecke.jpg","width":2075,"height":2500},"lang":"en","dir":"ltr","revision":"1179984116","tid":"d9306230-6ea5-11ee-94ae-23a5cb411197","timestamp":"2023-10-13T18:46:33Z","description":"Dutch politician (1798–1872)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Johan_Rudolph_Thorbecke","revisions":"https://en.wikipedia.org/wiki/Johan_Rudolph_Thorbecke?action=history","edit":"https://en.wikipedia.org/wiki/Johan_Rudolph_Thorbecke?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Johan_Rudolph_Thorbecke"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Johan_Rudolph_Thorbecke","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Johan_Rudolph_Thorbecke","edit":"https://en.m.wikipedia.org/wiki/Johan_Rudolph_Thorbecke?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Johan_Rudolph_Thorbecke"}},"extract":"Johan Rudolph Thorbecke was a Dutch liberal statesman, one of the most important Dutch politicians of the 19th century. Thorbecke is best known for heading the commission that drafted the revision of the Constitution of the Netherlands in 1848, amidst the liberal democratic revolutions of 1848. The new constitution transformed the country from an absolute monarchy into a constitutional monarchy, with the States General and the Council of Ministers becoming more powerful than the king. The amended constitution also granted individual rights to residents and citizens of the kingdom. This made the constitution one of the more progressive at the time. Thorbecke is generally considered a founding father of the modern political system of the Netherlands.","extract_html":"<p><b>Johan Rudolph Thorbecke</b> was a Dutch liberal statesman, one of the most important Dutch politicians of the 19th century. Thorbecke is best known for heading the commission that drafted the revision of the Constitution of the Netherlands in 1848, amidst the liberal democratic revolutions of 1848. The new constitution transformed the country from an absolute monarchy into a constitutional monarchy, with the States General and the Council of Ministers becoming more powerful than the king. The amended constitution also granted individual rights to residents and citizens of the kingdom. This made the constitution one of the more progressive at the time. Thorbecke is generally considered a founding father of the modern political system of the Netherlands.</p>","normalizedtitle":"Johan Rudolph Thorbecke"},{"type":"standard","title":"Constitutional_Reform_of_1848","displaytitle":"<span class=\"mw-page-title-main\">Constitutional Reform of 1848</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q2330714","titles":{"canonical":"Constitutional_Reform_of_1848","normalized":"Constitutional Reform of 1848","display":"<span class=\"mw-page-title-main\">Constitutional Reform of 1848</span>"},"pageid":46659715,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/2/26/Grondwet_1848_%281%29.JPG/320px-Grondwet_1848_%281%29.JPG","width":320,"height":240},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/2/26/Grondwet_1848_%281%29.JPG","width":3648,"height":2736},"lang":"en","dir":"ltr","revision":"1028255856","tid":"44abb8c0-62a3-11ee-885f-edf770f86ad7","timestamp":"2021-06-12T20:53:15Z","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Constitutional_Reform_of_1848","revisions":"https://en.wikipedia.org/wiki/Constitutional_Reform_of_1848?action=history","edit":"https://en.wikipedia.org/wiki/Constitutional_Reform_of_1848?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Constitutional_Reform_of_1848"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Constitutional_Reform_of_1848","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Constitutional_Reform_of_1848","edit":"https://en.m.wikipedia.org/wiki/Constitutional_Reform_of_1848?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Constitutional_Reform_of_1848"}},"extract":"The Constitutional Reform of 1848 laid the basis for the present system of parliamentary democracy in the Netherlands. It is often described as the original version of the Dutch Constitution that is still in force today. Under pressure from the Revolutions of 1848 in surrounding countries, King William II agreed to several demands of the liberal parliamentary opposition. The House of Representatives obtained much more influence, and was now directly elected. The reform was in some sense a peaceful revolution, in which liberal politician Johan Rudolph Thorbecke and King William II played important roles.","extract_html":"<p>The <b>Constitutional Reform of 1848</b> laid the basis for the present system of parliamentary democracy in the Netherlands. It is often described as the original version of the Dutch Constitution that is still in force today. Under pressure from the Revolutions of 1848 in surrounding countries, King William II agreed to several demands of the liberal parliamentary opposition. The House of Representatives obtained much more influence, and was now directly elected. The reform was in some sense a peaceful revolution, in which liberal politician Johan Rudolph Thorbecke and King William II played important roles.</p>","normalizedtitle":"Constitutional Reform of 1848"},{"type":"standard","title":"Monarchy_of_the_Netherlands","displaytitle":"<span class=\"mw-page-title-main\">Monarchy of the Netherlands</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q302958","titles":{"canonical":"Monarchy_of_the_Netherlands","normalized":"Monarchy of the Netherlands","display":"<span class=\"mw-page-title-main\">Monarchy of the Netherlands</span>"},"pageid":23416611,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/e/ea/Royal_coat_of_arms_of_the_Netherlands.svg/320px-Royal_coat_of_arms_of_the_Netherlands.svg.png","width":320,"height":351},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/e/ea/Royal_coat_of_arms_of_the_Netherlands.svg/952px-Royal_coat_of_arms_of_the_Netherlands.svg.png","width":952,"height":1045},"lang":"en","dir":"ltr","revision":"1183097677","tid":"13926ef0-7937-11ee-bd67-81623dbbb3b9","timestamp":"2023-11-02T04:19:50Z","description":"Constitutional and hereditary monarchy of the Kingdom of the Netherlands","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Monarchy_of_the_Netherlands","revisions":"https://en.wikipedia.org/wiki/Monarchy_of_the_Netherlands?action=history","edit":"https://en.wikipedia.org/wiki/Monarchy_of_the_Netherlands?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Monarchy_of_the_Netherlands"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Monarchy_of_the_Netherlands","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Monarchy_of_the_Netherlands","edit":"https://en.m.wikipedia.org/wiki/Monarchy_of_the_Netherlands?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Monarchy_of_the_Netherlands"}},"extract":"The monarchy of the Netherlands is a constitutional monarchy whose role and position are governed by the Constitution of the Netherlands. Roughly a third of the Constitution explains the succession, mechanisms of accession and abdication to the throne, the roles and duties of the monarch, the formalities of communication between the States General of the Netherlands, and the monarch's role in creating laws.","extract_html":"<p>The <b>monarchy of the Netherlands</b> is a constitutional monarchy whose role and position are governed by the Constitution of the Netherlands. Roughly a third of the Constitution explains the succession, mechanisms of accession and abdication to the throne, the roles and duties of the monarch, the formalities of communication between the States General of the Netherlands, and the monarch's role in creating laws.</p>","normalizedtitle":"Monarchy of the Netherlands"}],"year":1848},{"text":"French invasion of Russia: As Napoleon's Grande Armée began its retreat, its rear guard was defeated at the Battle of Vyazma.","pages":[{"type":"standard","title":"French_invasion_of_Russia","displaytitle":"<span class=\"mw-page-title-main\">French invasion of Russia</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q179250","titles":{"canonical":"French_invasion_of_Russia","normalized":"French invasion of Russia","display":"<span class=\"mw-page-title-main\">French invasion of Russia</span>"},"pageid":24334819,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/5/55/French_invasion_of_Russia_collage.jpg/320px-French_invasion_of_Russia_collage.jpg","width":320,"height":240},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/5/55/French_invasion_of_Russia_collage.jpg","width":1024,"height":768},"lang":"en","dir":"ltr","revision":"1183189045","tid":"aad7abd0-79b0-11ee-ae01-557650f6f905","timestamp":"2023-11-02T18:50:10Z","description":"1812 conflict during the Napoleonic Wars","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/French_invasion_of_Russia","revisions":"https://en.wikipedia.org/wiki/French_invasion_of_Russia?action=history","edit":"https://en.wikipedia.org/wiki/French_invasion_of_Russia?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:French_invasion_of_Russia"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/French_invasion_of_Russia","revisions":"https://en.m.wikipedia.org/wiki/Special:History/French_invasion_of_Russia","edit":"https://en.m.wikipedia.org/wiki/French_invasion_of_Russia?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:French_invasion_of_Russia"}},"extract":"The French invasion of Russia, also known as Russian campaign and in Russia as the Patriotic War of 1812, was launched by Napoleon to force the Russian Empire back into the continental blockade of the United Kingdom. Napoleon's invasion of Russia is one of the best studied military campaigns in history and is listed among the most lethal military operations in world history. It is characterized by the massive toll on human life: in less than six months nearly a million soldiers and civilians died.","extract_html":"<p>The <b>French invasion of Russia</b>, also known as <b>Russian campaign</b> and in Russia as the <b>Patriotic War of 1812</b>, was launched by Napoleon to force the Russian Empire back into the continental blockade of the United Kingdom. Napoleon's invasion of Russia is one of the best studied military campaigns in history and is listed among the most lethal military operations in world history. It is characterized by the massive toll on human life: in less than six months nearly a million soldiers and civilians died.</p>","normalizedtitle":"French invasion of Russia"},{"type":"standard","title":"Napoleon","displaytitle":"<span class=\"mw-page-title-main\">Napoleon</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q517","titles":{"canonical":"Napoleon","normalized":"Napoleon","display":"<span class=\"mw-page-title-main\">Napoleon</span>"},"pageid":69880,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/5/50/Jacques-Louis_David_-_The_Emperor_Napoleon_in_His_Study_at_the_Tuileries_-_Google_Art_Project.jpg/320px-Jacques-Louis_David_-_The_Emperor_Napoleon_in_His_Study_at_the_Tuileries_-_Google_Art_Project.jpg","width":320,"height":534},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/5/50/Jacques-Louis_David_-_The_Emperor_Napoleon_in_His_Study_at_the_Tuileries_-_Google_Art_Project.jpg","width":3079,"height":5135},"lang":"en","dir":"ltr","revision":"1183111183","tid":"8fcf31a0-794c-11ee-ac70-77591cfe23a3","timestamp":"2023-11-02T06:53:29Z","description":"Military leader and emperor of the French (1769–1821)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Napoleon","revisions":"https://en.wikipedia.org/wiki/Napoleon?action=history","edit":"https://en.wikipedia.org/wiki/Napoleon?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Napoleon"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Napoleon","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Napoleon","edit":"https://en.m.wikipedia.org/wiki/Napoleon?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Napoleon"}},"extract":"Napoleon Bonaparte, later known by his regnal name Napoleon I, was a French military commander and political leader who rose to prominence during the French Revolution and led successful campaigns during the Revolutionary Wars. He was the leader of the French Republic as First Consul from 1799 to 1804, then of the French Empire as Emperor of the French from 1804 until 1814, and briefly again in 1815. Napoleon's political and cultural legacy endures as a celebrated and controversial leader. He initiated many liberal reforms that have persisted through the years, and is considered one of the greatest military commanders in history. His campaigns are still studied at military academies worldwide. Between three and six million soldiers and civilians died in the Napoleonic Wars.","extract_html":"<p><b>Napoleon Bonaparte</b>, later known by his regnal name <b>Napoleon I</b>, was a French military commander and political leader who rose to prominence during the French Revolution and led successful campaigns during the Revolutionary Wars. He was the leader of the French Republic as First Consul from 1799 to 1804, then of the French Empire as Emperor of the French from 1804 until 1814, and briefly again in 1815. Napoleon's political and cultural legacy endures as a celebrated and controversial leader. He initiated many liberal reforms that have persisted through the years, and is considered one of the greatest military commanders in history. His campaigns are still studied at military academies worldwide. Between three and six million soldiers and civilians died in the Napoleonic Wars.</p>","normalizedtitle":"Napoleon"},{"type":"standard","title":"Grande_Armée","displaytitle":"<i>Grande Armée</i>","namespace":{"id":0,"text":""},"wikibase_item":"Q504721","titles":{"canonical":"Grande_Armée","normalized":"Grande Armée","display":"<i>Grande Armée</i>"},"pageid":308084,"lang":"en","dir":"ltr","revision":"1182431314","tid":"e3b23410-76e1-11ee-b276-a5d298673d29","timestamp":"2023-10-29T09:12:46Z","description":"Field Army of the French Imperial Army","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Grande_Arm%C3%A9e","revisions":"https://en.wikipedia.org/wiki/Grande_Arm%C3%A9e?action=history","edit":"https://en.wikipedia.org/wiki/Grande_Arm%C3%A9e?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Grande_Arm%C3%A9e"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Grande_Arm%C3%A9e","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Grande_Arm%C3%A9e","edit":"https://en.m.wikipedia.org/wiki/Grande_Arm%C3%A9e?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Grande_Arm%C3%A9e"}},"extract":"La Grande Armée was the main military component of the French Imperial Army commanded by Emperor Napoleon Bonaparte during the Napoleonic Wars. From 1804 to 1808, it won a series of military victories that allowed the French Empire to exercise unprecedented control over most of Europe. Widely acknowledged to be one of the greatest fighting forces ever assembled, it suffered enormous losses during the disastrous invasion of Russia in 1812, after which it never recovered its strategic superiority.","extract_html":"<p><span><i lang=\"fr\"><b>La Grande Armée</b></i></span> was the main military component of the French Imperial Army commanded by Emperor Napoleon Bonaparte during the Napoleonic Wars. From 1804 to 1808, it won a series of military victories that allowed the French Empire to exercise unprecedented control over most of Europe. Widely acknowledged to be one of the greatest fighting forces ever assembled, it suffered enormous losses during the disastrous invasion of Russia in 1812, after which it never recovered its strategic superiority.</p>","normalizedtitle":"Grande Armée"},{"type":"standard","title":"Rearguard","displaytitle":"<span class=\"mw-page-title-main\">Rearguard</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q980173","titles":{"canonical":"Rearguard","normalized":"Rearguard","display":"<span class=\"mw-page-title-main\">Rearguard</span>"},"pageid":17293333,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1b/USMC-090713-M-7693K-001.jpg/320px-USMC-090713-M-7693K-001.jpg","width":320,"height":214},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/1/1b/USMC-090713-M-7693K-001.jpg","width":3872,"height":2592},"lang":"en","dir":"ltr","revision":"1174807766","tid":"04b53d20-62a0-11ee-acee-adb10b460300","timestamp":"2023-09-10T20:15:48Z","description":"Military unit or personnel that protects the rear of the main force","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Rearguard","revisions":"https://en.wikipedia.org/wiki/Rearguard?action=history","edit":"https://en.wikipedia.org/wiki/Rearguard?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Rearguard"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Rearguard","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Rearguard","edit":"https://en.m.wikipedia.org/wiki/Rearguard?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Rearguard"}},"extract":"A rearguard or rear security is a part of a military force that protects it from attack from the rear, either during an advance or withdrawal. The term can also be used to describe forces protecting lines, such as communication lines, behind an army. Even more generally, a rearguard action may refer idiomatically to an attempt at preventing something though it is likely too late to be prevented; this idiomatic meaning may apply in either a military or non-military context.","extract_html":"<p>A <b>rearguard</b> or <b>rear security</b> is a part of a military force that protects it from attack from the rear, either during an advance or withdrawal. The term can also be used to describe forces protecting lines, such as communication lines, behind an army. Even more generally, a rearguard action may refer idiomatically to an attempt at preventing something though it is likely too late to be prevented; this idiomatic meaning may apply in either a military or non-military context.</p>","normalizedtitle":"Rearguard"},{"type":"standard","title":"Battle_of_Vyazma","displaytitle":"<span class=\"mw-page-title-main\">Battle of Vyazma</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q903472","titles":{"canonical":"Battle_of_Vyazma","normalized":"Battle of Vyazma","display":"<span class=\"mw-page-title-main\">Battle of Vyazma</span>"},"pageid":7574743,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/9/92/Battle_vyazma.jpg/320px-Battle_vyazma.jpg","width":320,"height":202},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/9/92/Battle_vyazma.jpg","width":1920,"height":1210},"lang":"en","dir":"ltr","revision":"1177261416","tid":"b8f2be10-67e2-11ee-bb36-9340ae522832","timestamp":"2023-09-26T23:32:42Z","description":"1812 battle during the French invasion of Russia","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Battle_of_Vyazma","revisions":"https://en.wikipedia.org/wiki/Battle_of_Vyazma?action=history","edit":"https://en.wikipedia.org/wiki/Battle_of_Vyazma?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Battle_of_Vyazma"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Battle_of_Vyazma","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Battle_of_Vyazma","edit":"https://en.m.wikipedia.org/wiki/Battle_of_Vyazma?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Battle_of_Vyazma"}},"extract":"The Battle of Vyazma, occurred at the beginning of Napoleon's retreat from Moscow. In this encounter a Russian force commanded by General Miloradovich inflicted heavy losses on the rear guard of the Grande Armée. Although the French thwarted Miloradovich's goal of encircling and destroying the corps of Marshal Davout, they withdrew in a partial state of disorder due to ongoing Russian harassment and heavy artillery bombardments. The French reversal at Vyazma, although indecisive, was significant due to its damaging impact on several corps of Napoleon's retreating army.","extract_html":"<p>The <b>Battle of Vyazma</b>, occurred at the beginning of Napoleon's retreat from Moscow. In this encounter a Russian force commanded by General Miloradovich inflicted heavy losses on the rear guard of the <i>Grande Armée</i>. Although the French thwarted Miloradovich's goal of encircling and destroying the corps of Marshal Davout, they withdrew in a partial state of disorder due to ongoing Russian harassment and heavy artillery bombardments. The French reversal at Vyazma, although indecisive, was significant due to its damaging impact on several corps of Napoleon's retreating army.</p>","normalizedtitle":"Battle of Vyazma"}],"year":1812},{"text":"War of the Third Coalition: The Treaty of Potsdam was signed compelling Prussia to join the coalition if it failed to negotiate peace between Russia and France.","pages":[{"type":"standard","title":"War_of_the_Third_Coalition","displaytitle":"<span class=\"mw-page-title-main\">War of the Third Coalition</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q249232","titles":{"canonical":"War_of_the_Third_Coalition","normalized":"War of the Third Coalition","display":"<span class=\"mw-page-title-main\">War of the Third Coalition</span>"},"pageid":178661,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/1/10/War_of_the_3rd_coalition.jpg/320px-War_of_the_3rd_coalition.jpg","width":320,"height":360},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/1/10/War_of_the_3rd_coalition.jpg","width":880,"height":990},"lang":"en","dir":"ltr","revision":"1177593069","tid":"9e189f30-778a-11ee-8f68-6d6e703a55b7","timestamp":"2023-09-28T10:05:44Z","description":"1805–1806 conflict during the Napoleonic Wars","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/War_of_the_Third_Coalition","revisions":"https://en.wikipedia.org/wiki/War_of_the_Third_Coalition?action=history","edit":"https://en.wikipedia.org/wiki/War_of_the_Third_Coalition?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:War_of_the_Third_Coalition"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/War_of_the_Third_Coalition","revisions":"https://en.m.wikipedia.org/wiki/Special:History/War_of_the_Third_Coalition","edit":"https://en.m.wikipedia.org/wiki/War_of_the_Third_Coalition?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:War_of_the_Third_Coalition"}},"extract":"The War of the Third Coalition was a European conflict spanning from 1805 to 1806. During the war, France and its client states under Napoleon I opposed an alliance, the Third Coalition, which was made up of the United Kingdom, the Austrian Empire, the Russian Empire, Naples, Sicily, and Sweden. Prussia remained neutral during the war.","extract_html":"<p>The <b>War of the Third Coalition</b> was a European conflict spanning from 1805 to 1806. During the war, France and its client states under Napoleon I opposed an alliance, the Third Coalition, which was made up of the United Kingdom, the Austrian Empire, the Russian Empire, Naples, Sicily, and Sweden. Prussia remained neutral during the war.</p>","normalizedtitle":"War of the Third Coalition"},{"type":"standard","title":"Treaty_of_Potsdam_(1805)","displaytitle":"<span class=\"mw-page-title-main\">Treaty of Potsdam (1805)</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q85810595","titles":{"canonical":"Treaty_of_Potsdam_(1805)","normalized":"Treaty of Potsdam (1805)","display":"<span class=\"mw-page-title-main\">Treaty of Potsdam (1805)</span>"},"pageid":59431762,"lang":"en","dir":"ltr","revision":"1180354890","tid":"79514450-6bd1-11ee-bd03-55895771f98f","timestamp":"2023-10-16T03:09:50Z","description":"1805 treaty between Prussia and Russia","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Treaty_of_Potsdam_(1805)","revisions":"https://en.wikipedia.org/wiki/Treaty_of_Potsdam_(1805)?action=history","edit":"https://en.wikipedia.org/wiki/Treaty_of_Potsdam_(1805)?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Treaty_of_Potsdam_(1805)"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Treaty_of_Potsdam_(1805)","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Treaty_of_Potsdam_(1805)","edit":"https://en.m.wikipedia.org/wiki/Treaty_of_Potsdam_(1805)?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Treaty_of_Potsdam_(1805)"}},"extract":"The Treaty of Potsdam was a treaty signed during the War of the Third Coalition on 3 November 1805 between Alexander I of the Russian Empire and Frederick William III of Prussia. It required Prussia to mediate negotiations between Napoleon's French Empire and Russia, and if the negotiations failed, join the Third Coalition.","extract_html":"<p>The <b>Treaty of Potsdam</b> was a treaty signed during the War of the Third Coalition on 3 November 1805 between Alexander I of the Russian Empire and Frederick William III of Prussia. It required Prussia to mediate negotiations between Napoleon's French Empire and Russia, and if the negotiations failed, join the Third Coalition.</p>","normalizedtitle":"Treaty of Potsdam (1805)"}],"year":1805},{"text":"French Revolution: Playwright, journalist and outspoken feminist Olympe de Gouges  was guillotined.","pages":[{"type":"standard","title":"French_Revolution","displaytitle":"<span class=\"mw-page-title-main\">French Revolution</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q6534","titles":{"canonical":"French_Revolution","normalized":"French Revolution","display":"<span class=\"mw-page-title-main\">French Revolution</span>"},"pageid":11188,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/5/57/Anonymous_-_Prise_de_la_Bastille.jpg/320px-Anonymous_-_Prise_de_la_Bastille.jpg","width":320,"height":252},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/5/57/Anonymous_-_Prise_de_la_Bastille.jpg","width":8332,"height":6571},"lang":"en","dir":"ltr","revision":"1183286983","tid":"4e596c50-7a36-11ee-8269-1bf558cac365","timestamp":"2023-11-03T10:46:49Z","description":"Revolution in France from 1789 to 1799","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/French_Revolution","revisions":"https://en.wikipedia.org/wiki/French_Revolution?action=history","edit":"https://en.wikipedia.org/wiki/French_Revolution?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:French_Revolution"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/French_Revolution","revisions":"https://en.m.wikipedia.org/wiki/Special:History/French_Revolution","edit":"https://en.m.wikipedia.org/wiki/French_Revolution?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:French_Revolution"}},"extract":"The French Revolution was a period of political and societal change in France that began with the Estates General of 1789, and ended with the formation of the French Consulate in November 1799. Many of its ideas are considered fundamental principles of liberal democracy, while its values and institutions remain central to modern French political discourse.","extract_html":"<p>The <b>French Revolution</b> was a period of political and societal change in France that began with the Estates General of 1789, and ended with the formation of the French Consulate in November 1799. Many of its ideas are considered fundamental principles of liberal democracy, while its values and institutions remain central to modern French political discourse.</p>","normalizedtitle":"French Revolution"},{"type":"standard","title":"Olympe_de_Gouges","displaytitle":"<span class=\"mw-page-title-main\">Olympe de Gouges</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q206972","titles":{"canonical":"Olympe_de_Gouges","normalized":"Olympe de Gouges","display":"<span class=\"mw-page-title-main\">Olympe de Gouges</span>"},"pageid":407530,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/05/Olympe_de_Gouges.png/320px-Olympe_de_Gouges.png","width":320,"height":427},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/05/Olympe_de_Gouges.png","width":816,"height":1090},"lang":"en","dir":"ltr","revision":"1183288168","tid":"26999260-7a38-11ee-9f1a-ddbf9174f75f","timestamp":"2023-11-03T11:00:04Z","description":"French playwright and activist (1748–1793)","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Olympe_de_Gouges","revisions":"https://en.wikipedia.org/wiki/Olympe_de_Gouges?action=history","edit":"https://en.wikipedia.org/wiki/Olympe_de_Gouges?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Olympe_de_Gouges"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Olympe_de_Gouges","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Olympe_de_Gouges","edit":"https://en.m.wikipedia.org/wiki/Olympe_de_Gouges?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Olympe_de_Gouges"}},"extract":"Olympe de Gouges was a French playwright and political activist. She is best known for her Declaration of the Rights of Woman and of the Female Citizen and other writings on women's rights and abolitionism.","extract_html":"<p><b>Olympe de Gouges</b> was a French playwright and political activist. She is best known for her Declaration of the Rights of Woman and of the Female Citizen and other writings on women's rights and abolitionism.</p>","normalizedtitle":"Olympe de Gouges"},{"type":"standard","title":"Guillotine","displaytitle":"<span class=\"mw-page-title-main\">Guillotine</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q128015","titles":{"canonical":"Guillotine","normalized":"Guillotine","display":"<span class=\"mw-page-title-main\">Guillotine</span>"},"pageid":51272,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0f/Guillotine_Luxembourg_01.jpg/320px-Guillotine_Luxembourg_01.jpg","width":320,"height":427},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Guillotine_Luxembourg_01.jpg","width":2304,"height":3072},"lang":"en","dir":"ltr","revision":"1183254805","tid":"790a77c0-79fd-11ee-ab71-a7ee32c42389","timestamp":"2023-11-03T04:00:03Z","description":"Apparatus designed for carrying out executions by beheading","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Guillotine","revisions":"https://en.wikipedia.org/wiki/Guillotine?action=history","edit":"https://en.wikipedia.org/wiki/Guillotine?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Guillotine"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Guillotine","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Guillotine","edit":"https://en.m.wikipedia.org/wiki/Guillotine?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Guillotine"}},"extract":"A guillotine is an apparatus designed for efficiently carrying out executions by beheading. The device consists of a tall, upright frame with a weighted and angled blade suspended at the top. The condemned person is secured with a pillory at the bottom of the frame, holding the position of the neck directly below the blade. The blade is then released, swiftly and forcefully decapitating the victim with a single, clean pass; the head falls into a basket or other receptacle below.","extract_html":"<p>A <b>guillotine</b> is an apparatus designed for efficiently carrying out executions by beheading. The device consists of a tall, upright frame with a weighted and angled blade suspended at the top. The condemned person is secured with a pillory at the bottom of the frame, holding the position of the neck directly below the blade. The blade is then released, swiftly and forcefully decapitating the victim with a single, clean pass; the head falls into a basket or other receptacle below.</p>","normalizedtitle":"Guillotine"}],"year":1793},{"text":"The Parliament of England passed the first Act of Supremacy, making King Henry VIII head of the Church of England, supplanting the pope and the Catholic Church.","pages":[{"type":"standard","title":"Parliament_of_England","displaytitle":"<span class=\"mw-page-title-main\">Parliament of England</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q1130737","titles":{"canonical":"Parliament_of_England","normalized":"Parliament of England","display":"<span class=\"mw-page-title-main\">Parliament of England</span>"},"pageid":378033,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/Coat_of_Arms_of_England_%281558-1603%29.svg/320px-Coat_of_Arms_of_England_%281558-1603%29.svg.png","width":320,"height":320},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/Coat_of_Arms_of_England_%281558-1603%29.svg/1550px-Coat_of_Arms_of_England_%281558-1603%29.svg.png","width":1550,"height":1550},"lang":"en","dir":"ltr","revision":"1180496158","tid":"cd7cae40-6c83-11ee-81e6-a712230da287","timestamp":"2023-10-17T00:26:18Z","description":"Legislature of England, c. 1215 to 1707","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Parliament_of_England","revisions":"https://en.wikipedia.org/wiki/Parliament_of_England?action=history","edit":"https://en.wikipedia.org/wiki/Parliament_of_England?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Parliament_of_England"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Parliament_of_England","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Parliament_of_England","edit":"https://en.m.wikipedia.org/wiki/Parliament_of_England?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Parliament_of_England"}},"extract":"The Parliament of England was the legislature of the Kingdom of England from the 13th century until 1707 when it was replaced by the Parliament of Great Britain. Parliament evolved from the great council of bishops and peers that advised the English monarch. Great councils were first called Parliaments during the reign of Henry III. By this time, the king required Parliament's consent to levy taxation.","extract_html":"<p>The <b>Parliament of England</b> was the legislature of the Kingdom of England from the 13th century until 1707 when it was replaced by the Parliament of Great Britain. Parliament evolved from the great council of bishops and peers that advised the English monarch. Great councils were first called Parliaments during the reign of Henry III. By this time, the king required Parliament's consent to levy taxation.</p>","normalizedtitle":"Parliament of England"},{"type":"standard","title":"Acts_of_Supremacy","displaytitle":"<span class=\"mw-page-title-main\">Acts of Supremacy</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q392226","titles":{"canonical":"Acts_of_Supremacy","normalized":"Acts of Supremacy","display":"<span class=\"mw-page-title-main\">Acts of Supremacy</span>"},"pageid":367969,"lang":"en","dir":"ltr","revision":"1180074294","tid":"bb5cf810-7a3d-11ee-862d-cf2fefaa9de7","timestamp":"2023-10-14T10:17:35Z","description":"16th century English laws establishing Royal Supremacy","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Acts_of_Supremacy","revisions":"https://en.wikipedia.org/wiki/Acts_of_Supremacy?action=history","edit":"https://en.wikipedia.org/wiki/Acts_of_Supremacy?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Acts_of_Supremacy"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Acts_of_Supremacy","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Acts_of_Supremacy","edit":"https://en.m.wikipedia.org/wiki/Acts_of_Supremacy?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Acts_of_Supremacy"}},"extract":"The Acts of Supremacy are two acts passed by the Parliament of England in the 16th century that established the English monarchs as the head of the Church of England; two similar laws were passed by the Parliament of Ireland establishing the English monarchs as the head of the Church of Ireland. The 1534 Act declared King Henry VIII and his successors as the Supreme Head of the Church, replacing the Pope. This first Act was repealed during the reign of the Catholic Queen Mary I. The 1558 Act declared Queen Elizabeth I and her successors the Supreme Governor of the Church, a title that the British monarch still holds.","extract_html":"<p>The <b>Acts of Supremacy</b> are two acts passed by the Parliament of England in the 16th century that established the English monarchs as the head of the Church of England; two similar laws were passed by the Parliament of Ireland establishing the English monarchs as the head of the Church of Ireland. The 1534 Act declared King Henry VIII and his successors as the Supreme Head of the Church, replacing the Pope. This first Act was repealed during the reign of the Catholic Queen Mary I. The 1558 Act declared Queen Elizabeth I and her successors the Supreme Governor of the Church, a title that the British monarch still holds.</p>","normalizedtitle":"Acts of Supremacy"},{"type":"standard","title":"Henry_VIII","displaytitle":"<span class=\"mw-page-title-main\">Henry VIII</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q38370","titles":{"canonical":"Henry_VIII","normalized":"Henry VIII","display":"<span class=\"mw-page-title-main\">Henry VIII</span>"},"pageid":14187,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f9/After_Hans_Holbein_the_Younger_-_Portrait_of_Henry_VIII_-_Google_Art_Project.jpg/320px-After_Hans_Holbein_the_Younger_-_Portrait_of_Henry_VIII_-_Google_Art_Project.jpg","width":320,"height":563},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/f/f9/After_Hans_Holbein_the_Younger_-_Portrait_of_Henry_VIII_-_Google_Art_Project.jpg","width":2041,"height":3589},"lang":"en","dir":"ltr","revision":"1182959066","tid":"6b42d2b0-78b1-11ee-8ce8-e3deddfc651d","timestamp":"2023-11-01T12:23:02Z","description":"King of England from 1509 to 1547","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Henry_VIII","revisions":"https://en.wikipedia.org/wiki/Henry_VIII?action=history","edit":"https://en.wikipedia.org/wiki/Henry_VIII?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Henry_VIII"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Henry_VIII","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Henry_VIII","edit":"https://en.m.wikipedia.org/wiki/Henry_VIII?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Henry_VIII"}},"extract":"Henry VIII was King of England from 22 April 1509 until his death in 1547. Henry is best known for his six marriages, and his efforts to have his first marriage annulled. His disagreement with Pope Clement VII about such an annulment led Henry to initiate the English Reformation, separating the Church of England from papal authority. He appointed himself Supreme Head of the Church of England and dissolved convents and monasteries, for which he was excommunicated by the pope.","extract_html":"<p><b>Henry VIII</b> was King of England from 22 April 1509 until his death in 1547. Henry is best known for his six marriages, and his efforts to have his first marriage annulled. His disagreement with Pope Clement VII about such an annulment led Henry to initiate the English Reformation, separating the Church of England from papal authority. He appointed himself Supreme Head of the Church of England and dissolved convents and monasteries, for which he was excommunicated by the pope.</p>","normalizedtitle":"Henry VIII"},{"type":"standard","title":"Church_of_England","displaytitle":"<span class=\"mw-page-title-main\">Church of England</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q82708","titles":{"canonical":"Church_of_England","normalized":"Church of England","display":"<span class=\"mw-page-title-main\">Church of England</span>"},"pageid":5955,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Logo_of_the_Church_of_England.svg/320px-Logo_of_the_Church_of_England.svg.png","width":320,"height":229},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Logo_of_the_Church_of_England.svg/700px-Logo_of_the_Church_of_England.svg.png","width":700,"height":500},"lang":"en","dir":"ltr","revision":"1182701145","tid":"2229c480-776c-11ee-aba8-f98b8e42c4eb","timestamp":"2023-10-30T21:34:29Z","description":"Anglican state church in England","description_source":"local","content_urls":{"desktop":{"page":"https://en.wikipedia.org/wiki/Church_of_England","revisions":"https://en.wikipedia.org/wiki/Church_of_England?action=history","edit":"https://en.wikipedia.org/wiki/Church_of_England?action=edit","talk":"https://en.wikipedia.org/wiki/Talk:Church_of_England"},"mobile":{"page":"https://en.m.wikipedia.org/wiki/Church_of_England","revisions":"https://en.m.wikipedia.org/wiki/Special:History/Church_of_England","edit":"https://en.m.wikipedia.org/wiki/Church_of_England?action=edit","talk":"https://en.m.wikipedia.org/wiki/Talk:Church_of_England"}},"extract":"The Church of England is the established Christian church in England. It traces its history to the Christian church recorded as existing in the Roman province of Britain by the 3rd century and to the 6th-century Gregorian 