es and later the Vatican City State since the eighth century. From a Catholic viewpoint, the primacy of the bishop of Rome is largely derived from his role as the apostolic successor to Saint Peter, to whom primacy was conferred by Jesus, who gave Peter the Keys of Heaven and the powers of \"binding and loosing\", naming him as the \"rock\" upon which the Church would be built. The current pope is Francis, who was elected on 13 March 2013.","extract_html":"<p>The <b>pope</b>, also known as the <b>supreme pontiff</b>, <b>Roman pontiff</b> or <b>sovereign pontiff</b>, is the <b>bishop of Rome</b>, head of the worldwide Catholic Church, and has also served as the head of state or sovereign of the Papal States and later the Vatican City State since the eighth century. From a Catholic viewpoint, the primacy of the bishop of Rome is largely derived from his role as the apostolic successor to Saint Peter, to whom primacy was conferred by Jesus, who gave Peter the Keys of Heaven and the powers of \"binding and loosing\", naming him as the \"rock\" upon which the Church would be built. The current pope is Francis, who was elected on 13 March 2013.</p>","normalizedtitle":"Pope"},{"type":"standard","title":"Catholic_Church","displaytitle":"<span class=\"mw-page-title-main\">Catholic Church</span>","namespace":{"id":0,"text":""},"wikibase_item":"Q9592","titles":{"canonical":"Catholic_Church","normalized":"Catholic Church","display":"<span class=\"mw-page-title-main\">Catholic Church</span>"},"pageid":606848,"thumbnail":{"source":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0e/Saint_Peter%27s_Basilica_facade%2C_Rome%2C_Italy.jpg/320px-Saint_Peter%27s_Basilica_facade%2C_Rome%2C_Italy.jpg","width":320,"height":213},"originalimage":{"source":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Saint_Peter%27s_Basilica_facade%2C_Rome%2C_Italy.jpg","width":4470,"height":2975},"lang":"en","dir":"ltr","revision":"1182544864","tid":"098424f0-7886-11ee-b156-158e5e97700e","time